INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (476,'SUPER SOFT HEADPAD','SUPER SOFT HEADPAD',2,'http://www.airshopparts.com/divio-boutique/documents/images/produits/stylespilotshop-2263-3124431106.jpg'),
 (477,'PLANCHE DE VOL','PLANCHE DE VOL',3,'http://www.airshopparts.com/divio-boutique/documents/images/produits/112.jpg'),
 (478,'PLANCHE DE VOL','PLANCHE DE VOL',3,'http://www.airshopparts.com/divio-boutique/documents/images/produits/110.jpg'),
 (479,'Le Bo-Rifle était une arme à énergie dont la particularité était de pouvoir servir tant d\'arme à distance que d\'arme de corps-à-corps. En effet, le Bo-Rifle pouvait être déployé sous la forme d\'un bâton dont les extrémités étaient composées d\'émetteurs énergétiques. Il était en cela semblable aux Bâtons Électrostatiques qui équipaient les Magna Gardes du tristement célèbre Général Grievous. Replié, le Bo-Rifle pouvait servir de fusil blaster. De plus, il était possible de le rabattre davantage sous une forme encore plus compacte, qui permettait un transport aisé.','AB-75 Bo-Rifle',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/borifle_avv6.jpg'),
 (480,'Cet arc à énergie est un genre d\'arme unique dans la galaxie. En effet, seules les Soeurs de la Nuit utilisaient cette arme. La corde et la flèche qui en sort sont faites de plasma pur, d\'apparence rose brillant. Au milieu de la corde, afin de pouvoir tirer la flèche plasma sans problème, se trouvait une prise, permettant de ne pas endommager les mains de l\'utilisateur. Lorsque toutes les flèches de plasma sont utilisées, la corde peut être utilisée comme une matraque afin d\'être toujours en possibilité de combattre et de se défendre. C\'était l\'arme de prédilection des Soeurs de la Nuit durant la Guerre des Clones, et il représentait le clan en lui-même. Certaines membres du clan étaient entraînées spécialement pour maîtriser au mieux cet arc unique. En général, les Soeurs accueillant les étrangers étaient armées de leur arc au cas où la situation pouvait dégénérer. De même, lorsque le Général Grievous attaqua le clan sur Dathomir, elles défendirent leurs positions avec férocité, bien que le clan fut annihilé par les troupes du général. L\'arc n\'avait effectivement pas la cadence de tir d\'un blaster et restait moins efficace dans sa globalité.','Arc à énergie',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/arc_energie_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (481,'Le bâton amphi est natif de Yuuzhan’tar, le monde natal des Yuuzhan Vong. Les jeunes bâtons poussent par trois dans des polypes relativement fournis, essayant d’atteindre et de tuer toute proie s’aventurant trop près du bosquet. Tel est leur état naturel. Lorsqu’ils grandissent jusqu’à leur taille adulte de 2 ou 3 mètres, les bâtons amphi se détachent de leur polype pour s’abandonner à la vie sauvage, laissant le polype agoniser. Entre les mains d\'un maître Yuuzhan Vong, le bâton amphi peut devenir une arme mortelle. Le bâton amphi est un serpent violent qui peut durcir tout ou partie de son corps jusqu\'à ce qu\'il soit aussi solide que de la pierre, que seule l’armure vonduun pourrait concurrencer en terme de rigidité. En modifiant l\'épaisseur de son cou et de sa queue, le bâton amphi peut couper comme un rasoir ou bien devenir souple et semblable à un fouet. Quand il est utilisé par un guerrier expert, il peut même devenir un missile mortel quand on le projette comme une lance. Il est aussi capable de cracher du venin jusqu\'à vingt mètres avec une précision étonnante, laissant sa victime agoniser près de vingt heures avant de succomber. Ce venin aveugle ses victimes instantanément et les tue lentement en pénétrant à travers les pores et les plaies sur la peau : une bio-toxine contrant les effets du poison sera élaborée au cours de la guerre par Mara Jade Skywalker. A la grande frayeur des Jedi, le bâton amphi est immunisé contre les lames des sabres laser ; sa peau épaisse ne s’ouvre que lorsque plusieurs coups frappent le même endroit. La seule méthode connue à ce jour pour assassiner un bâton amphi est de lui trancher la tête. De part leur nature organique, les bâtons amphi sont capables de se remettre eux-mêmes d’une multitude de blessures. Le bâton amphi est couramment utilisé par les Yuuzhan Vong, à tous les échelons. Il existe ainsi des versions modifiées.','Bâton Amphi',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/baton_amphi_avv6.jpg'),
 (482,'Le Beskad est un ancien sabre Mandalorien, traditionnellement utilisé dans les combats et forgé en Beskar dans les forges Mandaloriennes. Les propriétés du fer extrait sur Mandalore donne une force et une résistance hors du commun aux sabres, leur permettant notamment de combattre des sabres laser.  Le Beskad a une lame de quarante-cinq centimètres de longueur et peut atteindre six centimètres de largeur, pour un poids de deux kilogrammes au minimum. La poignée est généralement en cuir, la lame est aiguisée sur un seul bord et légèrement courbée.  On raconte que tenir cette arme donne la sensation de tenir une machette ou un marteau. Le Beskad est d\'ailleurs souvent plus utilisé comme un marteau que comme un vrai sabre.   Puisque leur longueur est deux fois inférieure à celle d\'un sabre normal, les Mandaloriens ont appris à perfectionner des techniques rapprochées pour vaincre leurs adversaires. La maîtrise de ce sabre repose sur l\'habileté et l\'expérience, mais le Beskad peut se révéler d\'une redoutable efficacité contre les sabres laser. Un utilisateur confirmé peut éliminer l\'avantage de la portée du sabre laser en profitant de la nécessité de devoir combattre de manière rapprochée. Cette arme fut souvent utilisée à l\'époque de l\'Ancienne République et également par Goran Beviin à l\'époque de la Seconde Guerre Civile Galactique. Lorsque Jaina Solo arriva sur Mandalore pour demander de l\'aide à Boba Fett, Beviin a donné une leçon de techniques rudimentaires au Beskad à la Jedi. En utilisant cette arme spéciale, il lui a montré qu\'il existait différentes manières de se battre et que le sabre laser rendait les choses trop prévisibles. ','Beskad',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (483,'Fusil de la série des blaster DC produit par BlasTech Insdustries, le DC-15s est, comme le DC-15a, l’arme qui équipait tous les soldats Clones. Tirant jusqu’à 500 coups de plasma, ce fusil est avant tout un dernier recours, en effet non modifiable ce blaster s’illustre surtout lors de combat au corps-à corps. Devenant de plus en plus obsolète vers la fin du conflit, il fut remplacé petit à petit par le DC-17. BlasTech Industries le remplacera sous l’Empire par le fusil blaster E-11, plus fiable, plus précis et programmable à souhaits.','Blaster DC-15S',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_dc15s_avv6.jpg'),
 (484,'Arme de prédilection des Shadow Troopers Clones, le fusil-blaster DC-19 était une arme remarquable. En effet surnommé le blaster « furtif », son tir en mode « invisible » ne se voyait pas. BlasTech Industries a dû pour cela utiliser un mélange de gaz tibana ultra-raffiné. Equipé en plus d’un silencieux, cette arme redoutable était parfaite pour les missions de reconnaissance ou d’infiltration nécessitant une très grande discrétion. Hormis le prix des cartouches, son seul problème était la surchauffe liée à l’utilisation, ainsi au bout de 10 tirs le Soldat devait laisser refroidir l’arme pour éviter de l‘endommager ou de la détruire.','Blaster DC-19',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_dc19_avv6.jpg'),
 (485,'Créé par Blastech Industries, le blaster DC-15s vient compléter la panoplie offerte par le DC-17m. De courte portée et de précision variable, cette arme de poing s’avère efficace lorsque les munitions primaires viennent à manquer ou lorsque l’espace de combat est relativement réduit. Contrairement à l’arme lourde des commandos, le DC-15s ne fonctionne pas à partir de cartouches de gaz Tibanna. En effet, son autonomie repose sur une cellule d’énergie qui se recharge automatiquement une fois sa capacité de tir maximale atteinte. L’énergie est ainsi concentrée jusqu’à former un projectile de plasma qui peut néanmoins faire de sérieux dégâts sur un blindage léger. Malgré un temps de rechargement assez long lorsqu’il y a un risque vital, ce blaster reste une arme mortelle dans les mains expérimentées d’un commando avec ses sept tirs par seconde.','Blaster de poing DC-15 S',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_poing_dc15_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (486,'Le blaster DC-17 issu du pistolet blaster classique est plus communément utilisé par les Capitaines ARC, tels Fordo, par les Commandants clones et les Jet-Troopers. Produit de BlasTech Industries, il diffère peu du baster DC-15 ; hormis les cartouches de gaz rondes, le DC-17 peut être réglé de différentes manières suivant la cible à attaquer : à faible intensité son tir pouvait détruire un simple droïde de combat B1, mais à puissance maximale, il pouvait percer le blindage d’un Char d’Assaut Blindé (CAB). Pouvant tirer environ 50 coups par cartouche et le plus souvent utilisé en double, une dans chaque main, cette arme est aussi maniable que redoutable.','Blaster de poing DC-17',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_dc17_avv6.jpg'),
 (487,'Le blaster Westar-M5 à répétition est une arme très communément utilisée par les ARC mais aussi par les Marines Galactiques. C’est une arme très efficace et mortelle dont un simple tir suffit à tuer l’ennemi. Ce fusil peut être calibré en automatique, en semi-automatique ou encore en mode rafale. Il dispose d’une foule d’équipements dont un micro lance-roquettes PLX-1m.','Blaster Westar-M5',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/westarm5_avv6.jpg'),
 (488,'Le canon blaster rotatif Z-6 est une arme également dévastatrice développée par Merr-Sonn qui dispose de six canons tirant à tour de rôle. Ce fusil dispose d’un système de refroidissement très efficace puisque le blaster peut faire 166 tours par seconde à pleine capacité. Cependant, cette arme présente plusieurs défauts notables : sa consommation en munitions, son poids important et sa taille imposante.','Canon blaster rotatif Z-6',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/canonz6_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (489,'Rappelant les jours anciens des guerriers Yuuzhan Vong, le coufee est un couteau de cérémonie à double tranchant grossier mais efficace dont la forme est légèrement incurvée. Les Guerriers Yuuzhan Vong montrent cette arme lors de leurs prières à Yun-Yammka, le dieu Yuuzhan Vong de la guerre et s’en servent également comme arme favorite pour le suicide. Ces armes sont également employées parmi les Chazrach.','Coufee',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/coufee_avv6.jpg'),
 (490,'Le crache-flamme est une créature utilisée par l’infanterie Yuuzhan Vong. Il s’agit d’une version miniaturisée du cracheur de feu et peut être considérée comme l’analogue du lance-flamme. Les Yuuzhan Vong qui les utilisaient se voyaient retirer l’os d’un de leur bras pour être remplacé par la colonne vertébrale de la créature. Le crache-flamme reste enroulé autour du bras de son maître jusqu’à ce qu’il lui ordonne de cracher. Les flammes sont créées par une boule de biomatière qui exhale des produits chimiques à l’intérieur du cracheur. Ces armes dangereuses sont donc peu usitées.','Crache-flamme',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (491,'Le crache-magma est une arme de l’infanterie Yuuzhan Vong, une sorte de Yaret-Kor miniaturisé.','Crache-magma',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (492,'Le fouet laser est une variante rare et très exotique du traditionnel sabre laser. En effet, si la poignée est semblable à celle d\'un sabre laser classique, l\'énergie n\'en sort pas sous forme d\'une lame, mais d\'un long ruban d\'énergie flexible qui se forme sur une ou des lanières, ce qui le rend manipulable à la manière d\'un fouet. Bien que sa portée soit plus grande, du fait de son allonge par rapport à un sabre classique (plusieurs mètres pour les lanières contre un pour la lame en moyenne), sa puissance est réduite. Si il peut provoquer amputations et autres désagréments lors d\'un duel, il est en revanche inefficace pour traverser des parois par exemple. Les lanières font déjà partie de la structure du fouet, ce qui fait que l\'énergie se concentre sur cette gaine métallique centrale, et ne sort pas du vide, contrairement à un sabre où il n\'y a pas de \'support\' physique pour l\'énergie. A noter que cette arme peut ne pas trancher son adversaire et s\'enrouler autour du solide. Dark Maleval nous donne un bon exemple de ce genre d\'utilisation. On peut utiliser cette spécificité pour faire chuter l\'adversaire ou le bloquer. La rareté de cette arme en combat singulier déstabilise l\'adversaire qui ne sait quelle technique adopter, n\'ayant aucune expérience contre un fouet laser, jetant la confusion dans son esprit, procurant un avantage certain. Un autre avantage dont elle bénéficie face au possesseur d\'un sabre laser classique est que sa lame rigide est incapable de parer le fantastique pouvoir mouvant du fouet. Son utilisateur a la possibilité de bloquer la lame de son adversaire en enroulant le fouet autour de celle-ci. Le porteur du sabre doit soit essayer de le dégager, ce qui détourne son attention de l\'ennemi, soit éteindre la lame, et laisser la porte ouverte à une attaque. Le ruban d\'énergie est en effet capable de se tordre, de pivoter et de claquer en réponse aux mouvements de son possesseur et de sa maîtrise de la Force, ce qui rend sa maîtrise martiale encore plus difficile que celle d\'un double sabre laser. L\'adresse requise est très différente et bien plus complexe, car il faut contrôler le mouvement de chaque lanière. Un seul instant d\'inattention peut coûter la vie à l\'utilisateur. C\'est pourquoi ses principaux propriétaires sont des utilisateurs de la Force. On peut donc retenir du fouet laser qu\'il est une arme quasiment imparable, conçu pour causer beaucoup de souffrance à celui contre qui on l\'utilise avant de le tuer, mais qu\'il est d\'autant plus dangereux pour celui qui le manie. Egalement, tout comme un sabre standard, son rayon d\'énergie change de couleur selon le cristal utilisé. Une de ses faiblesses est le sabre court, appelé shoto, créé par Luke Skywalker qui l\'utilisa à de nombreuses reprises contre Lumiya, tout comme Mara Jada Skywalker. Le shoto complète le sabre normal et permet de contrer plusieurs lanières du fouet, diminuant l\'efficacité de l\'arme.','Fouet-Laser',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/fouetlaser_avv6.jpg'),
 (493,'Version améliorée du célèbre fusil blaster E-11 utilisé par les Soldats de Chocs impériaux, le modèle ARC-9965 se répandit au sein des forces Sith-Impériales durant le règne de Dark Krayt. Les modèles E-15 et E-19, développés par les Vestiges de l\'Empire, ne disposant pas, au goût des Sith, de suffisamment de puissance de feu, il fut commandé à BlasTech Industries une arme répondant à ce critère. L\'ARC-9965 ainsi développé était donc légèrement plus lourd (5 kilos) mais beaucoup plus puissant, tout en conservant une très bonne précision. Le seul point négatif fut la forte réduction de la durée de vie des cellules énergétiques, davantage sollicitées par des tirs à grande puissance (de 500 à 40 coups).','Fusil Blaster ARC-9965',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_arc9965_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (494,'Le DC-15a est l’une des deux armes composant l’armement du soldat clone. Construit par BlasTech Industries, ce fusil blaster est une arme redoutable. En effet, sa puissance peut être modifiée à l’aide d’une petite manette. Le DC-15a peut percer un mur en ferrobéton situé à 10 kilomètres. Son secret réside dans la transformation du gaz Tibanna en particules ioniques expulsées à l’aide une série d’électroaimants. En mode normal, le DC-15a possède un ratio de 500 tirs par cartouche et une portée de 400 mètres. Long d’un mètre, ce fusil est très efficace lors de combats « aérés », avec des cibles situées à grande distance. Le seul handicap du DC-15a est son poids, il est  tellement lourd que les Clones qui s’en servent sont obligés de le porter à deux mains. Deux autres caractéristiques sont à noter, il s’agit de la lunette de visée qui peut se retourner pour faciliter sa tenue, et le câble ascensionnel indispensable pour franchir les grands et hauts obstacles.','Fusil Blaster DC-15 A',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/dc15a_avv6.jpg'),
 (495,'Amélioration technologique du DC-15 manié par l’infanterie clone et construit par Blas tech Industries, le blaster DC-17m est l’arme de prédilection des commandos clones tels que l’escouade Delta ou encore l’escouade Omega. Véritable arsenal à lui seul, le DC-17m possède trois fonctions, toutes plus meurtrières les unes que les autres allant d’une portée courte à une portée longue. Le gaz des cartouches est ionisé afin de créer un projectile mortel à la vélocité importante. Le mode blaster simple permet de venir à bout des adversaires organiques ou droïdes les plus coriaces grâce à une cadence de tir impressionnante et à la puissance de feu dévastatrice de ses cartouches de gaz Tibanna. Le mode sniper est utilisé généralement dans les embuscades. D’une portée d’environ 10 km, les tirs sont aussi précis que meurtriers et peuvent percer n’importe quel blindage léger, grâce à une concentration accrue du gaz contenu dans les cartouches. Enfin, le mode lance-grenades est classiquement utilisé lors des assauts. La déflagration engendrée est alors capable de vaincre les blindages les plus lourds ou de venir totalement à bout d’une escouade ennemie. Chaque commando d’une escouade est spécialisé dans l’utilisation d’une des fonctions du blaster DC-17m.','Fusil Blaster DC-17 M',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/dc17m_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (496,'Parmi les fusils blasters utilisés fréquemment par les soldats, on peut trouver le Heavy Tracker de SoroSuub, le G8 de Merr-Sonn, ou encore le très puissant BlasTech A280. Cependant, aucun de ces modèles ne fait le poids face à la polyvalence et la fiabilité du Fusil Blaster E-11. Ce dernier a été créé par BlasTech Industries durant la Guerre Civile Galactique. C’était le fusil blaster standard des stormtroopers impériaux. Le fusil blaster E-11 devint renommé du fait de sa grande portée et de sa lourde puissance de feu. Ces deux critères semblent classiques pour ce type d’arme, mais pas pour un blaster si compact et si maniable. Son design léger et équilibré permettait une utilisation rapide, efficace et peu encombrante, parfois même à une seule main, et dans des espaces réduits. Ces atouts le rendaient presque aussi maniable qu’un pistolet blaster. Cependant, sa taille étant importante, il était plus facile et plus efficace de le tenir avec les deux mains. Le E-11 possédait également une crosse dépliable afin d’optimiser la visée, avec l’aide d’un viseur électronique. Ce dernier permettait de faire abstraction du brouillard et de la fumée, ainsi que des conditions d’obscurité. La portée maximale du fusil blaster était de 300 mètres, tandis que sa portée optimale était de 100 mètres, soit environ trois fois celle d’un pistolet blaster. La portée est aussi importante du fait que le canon est très long (environ la moitié de la taille de l’arme), ce qui produit un rayon puissant et très concentré. Tous les autres composants sont placés derrière ou sur le côté du blaster, afin de laisser prédominer les atouts cités ci-dessus. De plus, ces composants sont montés en un seul bloc, afin de pouvoir facilement démonter l’arme pour remplacer ou réparer les pièces abîmées. Afin d’éviter une accumulation de chaleur, un circuit de refroidissement s’enroulant autour de l’arme a été installé afin de garder la chaleur hors des composants « vitaux » de l’arme. Le chargeur, monté sur le côté de l’arme, contient assez d’énergie pour tirer 100 fois. Le E-11 peut être réglé sur plusieurs niveaux de puissance, allant du coup pouvant assommer la cible au tir à pleine puissance et mortel. Bien que les soldats Impériaux et Néo-Républicains utilisent le mode semi-automatique, afin de conserver les munitions et de limiter la surchauffe de l’arme, le E-11 peut être utilisé en mode automatique. De plus, il peut même être réglé au niveau de la cadence de tir. Cependant, une utilisation trop importante du mode automatique peut faire sortir le canon de son alignement.','Fusil Blaster E-11',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/e11_avv6.jpg'),
 (497,'Le DC-15x fut le fusil sniper longue portée le plus utilisé par la Grande Armée de la République. Construit par BlasTech Industries, il s’agissait en fait d’une modification du DC-15, fusil équipant tous les Clones pendant la guerre. Fusil destiné à de grands tireurs d’élite, le DC-15x était difficile à manier mais possédait une portée allant jusqu’à 500 mètres. Redoutable tant sur les droïdes que sur les êtres vivants, son semblable séparatiste, le E-5, possédait une plus grande portée et était entièrement automatique. Inutile en combat rapproché, le DC-15x fut utilisé pas les snipers clones puis les clones assassins. Plus tard, le E-11s lui succéda, possédant peu de différence avec le DC-15x, il équipa les Scouts-troopers impériaux.','Fusil Sniper DC-15x',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/dc15x_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (498,'La griffe de combat est une extension osseuse du squelette Yuuzhan Vong que les guerriers se font greffer. Lorsqu’elle est sortie, la griffe de combat est quatre fois plus longue que rentrée et même si le processus est douloureux, le guerrier n’hésite pas à se servir de cet atout mortel. Tranchante et acérée, la griffe de combat est également résistante puisque le sabre laser ne suffit pas à la couper. La griffe est généralement greffée sur les épaules et les mains des Yuuzhan Vong.  ','Griffe de combat',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/griffe_combat_avv6.jpg'),
 (499,'Le lance roquette PLX-1 appelé également PLEX est une arme très puissante qui est utilisée dés les premiers instants de la Guerre des Clones mais aussi après sa fin par différents groupes militaires. Produite par dizaines voire centaines de milliers d’exemplaires, c’est une arme qui est principalement destinée aux soldats de base pour pouvoir repousser les véhicules blindés séparatistes. Petit et facilement transportable, il reste néanmoins très puissant, pouvant détruire en quelques tirs des tanks AAT.','Lance-roquette PLX-1',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/plx-1_avv6.jpg'),
 (500,'Le Parang venait d\'un outil utilisé pour couper du petit bois. Il devint une arme utilisée par la Tribu Perdue des Sith depuis l\'Ancien Empire Sith. Il était fait d\'un manche et d\'une lame courbée. Le Parang avait la particularité de revenir à son envoyeur comme un boomerang. Il pouvait être fait en métal et parfois en verre.','Parang',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/parang_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (501,'Le Perturbateur Ionique T-7 était une arme portative à énergie extrêmement puissante, capable de mettre hors-service un vaisseau ou un véhicule terrestre, à la manière des canons à ion des engins spatiaux. Mais à cause de ses effets atroces sur les êtres vivants, posséder une telle arme était illégale sur la plupart des planètes de la Galaxie. Détenir un Perturbateur Ionique était même souvent passible de mort. L\'Empire Galactique est réputé avoir utilisé des Perturbateurs Ioniques, probablement à l\'instigation de l\'Agent Kallus du BSI, lors du massacre de Lasan qui aboutit à l\'extinction presque totale de l\'espèce des Lasat. Les Impériaux étaient en tout cas en possession d\'armes de ce type sur la planète Lothal, où ils semblaient vouloir lancer une production de masse.','Perturbateur Ionique T-7',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/t7_avv6.jpg'),
 (502,'Parmi les armes les plus communes de la galaxie, on retrouve les blasters et les pistolets blaster. Tous les conflits qui ont consumé la galaxie ont lancé les productions massives de ces types d\'armes, qui sont finalement devenues communes . Comme dans l\'industrie du Droïde par exemple, il y avait trois organisations industrielles principales pour la création de blaster : BlasTech Industries, Merr-Sonn Munitions et SoroSuub Corporation. Ces trois industries ont chacune conçu des types de blasters différents, que ce soit au niveau du type d\'arme ou au niveau de la puissance. Durant les dernières années de la République galactique, les Forces de Sécurité de diverses planètes utilisèrent ce blaster en tant qu\'arme principale. Après la déclaration du Nouvel Ordre (l\'Empire), le DH-17 devint une marchandise de contrebande, plus souvent trouvable sur le marché noir, ce qui fit bien les affaires des troupes Rebelles du fait de l\'excellent rapport qualité/prix. En effet, cette arme a longtemps été illégale pour le personnel non-militaire, que ce soit au temps de l\'Empire ou de la Nouvelle République. Une variante fut commercialisée lors de la Guerre Civile Galactique, la carabine DH-17 Parmi les personnages les plus connus portant cette arme, nous pouvons citer le contrebandier multi-tâches Lando Calrissian.','Pistolet Blaster DH-17',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/dh17_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (503,'Arme qui devint célèbre grâce au contrebandier Han Solo, le Pistolet Blaster DL-44 de BlasTech est aussi puissant qu’un fusil blaster, sauf qu’il fait la taille d’un pistolet standard. Elle devint rapidement l’arme préférée des bandits et autres contrebandiers, autrement dit pour les personnes exposées aux environnement hostiles, possédant des réflexes rapides et désireux de survivre par n’importe quels moyens. Cette arme était particulièrement étudiée pour les combats rapprochés, et était souvent portée par les Rebelles pour sa puissance et sa capacité à transpercer les armures des Stormtroopers. Le DL-44 causait en effet beaucoup de dommages, et se tenait facilement d’une main contrairement à d’autres blasters. La portée optimale est de 25 mètres, mais il peut tout de même atteindre une cible jusqu’à 50 mètres. L’énergie délivrée est quatre fois plus élevée qu’un blaster traditionnel, mais sa capacité est bien inférieure puisqu’il faut recharger au bout de 25 tirs. Du coup, le tireur doit faire attention à sa visée afin d\'être très efficace. Le grip vibre discrètement lorsqu’il ne reste plus que 5 tirs possibles, afin de prévenir le tireur d\'un rechargement imminent. Cependant, pour pallier ce léger problème, le chargeur se remplace très rapidement juste derrière la gâchette, via un levier qui permet de laisser tomber le chargeur vide. En général, les utilisateurs du DL-44 possèdent au moins une douzaine de chargeurs sur eux lors des combats. Han Solo possédait donc un DL-44 qu’il avait prit soin de largement améliorer. Il ajouta notamment une lunette avec un senseur, et augmenta la puissance de tir du pistolet blaster, tout en gardant la même dépense énergétique. Il portait son arme à la ceinture, dans un étui de révolver, lui permettant de dégainer rapidement en cas de combats rapprochés. Grâce à ces améliorations, mais aussi à ses talents innés, il tua quelques chasseurs de primes ou autres tueurs très réputés à travers la galaxie, comme Greedo, Uul-Rha-Shan ou encore Gallandro. Quand Solo devint plus respectable et se retira de la contrebande, il insista pour garder son arme avec lui, ce qui lui permit de protéger à plusieurs reprise sa femme Leia Organa Solo ou même ses enfants.','Pistolet Blaster DL-44',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/dl44_avv6.jpg'),
 (504,'Le WESTAR-35 est le digne successeur du WESTAR-20 et du WESTAR-34 - ce dernier fut utilisé par Jango Fett et son fils Boba. Le pistolet blaster WESTAR-35 fut utilisé par le leader de la Death Watch, Pre Vizsla, lors de la Guerre des Clones. Un peu plus tard, durant les dernières années de l\'Empire, c\'est Sabine Wren qui utilisait ce type de blaster pour mener à bien les opérations rebelles. Elle en possédait deux et faisait beaucoup de dégâts aux ennemis. Sa puissance de feu pouvait être réglée (mortel ou non), et, ainsi, Sabine avait déjà eu l\'occasion de \'tirer\' sur Ezra Bridger lors de ses entraînements de parade au sabre laser.','Pistolet Blaster WESTAR-35',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/westar35ava.png');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (505,'Créature ressemblant énormément à un globe oculaire Yuuzhan Vong, le plaeryin bol est une sorte de bouche qui peut cracher des gouttes venimeuses avec une grande précision jusqu\'à dix mètres selon la volonté de son hôte. Un simple froncement de paupières active le plaeryin bol. Nom Anor arracha son oeil avec un bâton incandescent quand il fut promu Exécuteur et le remplaça par un plaeryin bol. Après utilisation, le plaeryin bol produit à nouveau du venin lentement, en faisant une arme utilisable à l’infini. Il possède également l’avantage de faire des dommages réversibles : un antidote existe, que le porteur garde le plus souvent à l’intérieur de l’un de ses doigts, capable d’annihiler les effets fatals du plaeryin bol. Cela en fait un instrument de torture merveilleux afin de soutirer l’information à une victime en échange de l’antidote. Employé en présence d’eau, le plearyin bol peut être dangereux pour l’utilisateur. Si le porteur ose, par exemple, utilisé l’arme sous la pluie, le venin est susceptible d’être renvoyé par la pluie.','Plaeyrin Bol',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/plaeyrin_bol_avv6.jpg'),
 (506,'Le rituel de construction d’un sabre laser fait partie intégrante de la formation d’un Jedi. Cela met en pratique, non seulement l’habileté technologique du Padawan, mais également son lien avec la Force. Durant l’Ancienne République, les cavernes d’Ilum ou de Dantooine servaient à la fois de lieux de cérémonie et de gisements de cristaux, que les Jedi choisissaient après une longue méditation à travers la Force. Traditionnellement, la construction d’un sabre laser se déroule sur un mois mais il est dit qu’au plus fort de la Guerre des Clones, ce délai fut ramené, parfois, à deux jours seulement. Vue en coupe Fonctionnement Dès lors que le sabre est activé, la cellule d’alimentation libère de l’énergie qui se diffuse dans la chambre des cristaux (cristal principal et cristaux de mise au point). Ce flux est ensuite successivement chargé positivement et négativement afin de palier à toute déperdition d’énergie, ce qui entrainerait une émission de chaleur. Enfin, les supraconducteurs permettent à l’arme de se recharger d’elle-même en récupérant l’énergie émise pour la redistribuer à la cellule d’alimentation. Même s’il peut apparaître que tous les sabres laser se ressemblent, une inspection plus ou moins minutieuse permet de se rendre compte qu’ils sont tous uniques. Cela est dû à la volonté de personnalisation de leurs possesseurs mais aussi, parfois, aux nécessités physiologiques ou morphologiques de l’utilisateur. Défaut d\'assemblage Si l\'on inverse la cellule d\'énergie, cela provoque un court-circuit des activateurs de champs cycliques, et l\'explosion du sabre. C\'est ce qui arriva au sabre du jeune initié Petro en -21. Le jeune garçon, conscient du défaut de construction, s\'en servit pour neutraliser les pirates qui les avait attaqués, lui et quelques autres initiés, à bord du Crucible.','Sabre Laser',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/sabrelaser_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (507,'Ezra Bridger a construit son propre sabre laser en l\'an -4. C\'était un sabre laser fabriqué avec les moyens du bord, faisait également office de blaster. Bien que grossier, ce type de construction fut choisi en fonction de l\'environnement. En effet, durant ces années de guerres civiles et de résistance, Ezra ne pouvait se contenter de porter un sabre laser à usage unique. Surtout, il était beaucoup plus à l\'aise avec blaster qu\'avec un sabre laser, n\'étant que padawan et ne connaissant la Force que depuis quelques semaines. Il put le construire grâce à divers objets retrouvés dans le Ghost, après avoir récupéré un crystal Kyber dans le temple Jedi caché de Lothal.      ','Sabre Laser d\'Ezra Bridger',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/ezra_sabrelaser_ava.png'),
 (508,'La sabre laser de Kanan Jarrus était une arme démontable, en deux parties. En effet, grâce à cela, il réussit à ne pas se faire repérer alors qu\'il portait en permanence son sabre laser. Ce n\'est que 14 ans après la déclaration de l\'Ordre 66 et l\'apparition de l\'Empire qu\'il utilisa pour la première fois son sabre laser. Ce fut sur Kessel, lors d\'une mission de secours, où il sauva d\'ailleurs de nombreuses vies wookiees, qu\'il dégaina son arme. Par la même occasion, il révéla au grand jour sa vraie nature, et Kallus, l\'agent impérial lui faisant face, s\'empressa de signaler le Jedi auprès de l\'Inquisiteur, un chasseur de Jedi engagé par Dark Vador.','Sabre Laser de Kanan Jarrus',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/kanan_sabrelaser_ava.jpeg'),
 (509,'A l\'image du sabre laser de Dark Maul, le sabre laser de l\'Inquisiteur était un sabre laser à double lame. Selon le choix de son utilisateur, une ou deux lames pouvaient être utilisées durant un combat. De plus, le sabre laser pouvait être enclenché de telle sorte que les deux lames tournent autour du manche. Ainsi, lorsqu\'une cible s\'écartait d\'un face à face, l\'Inquisiteur avait pour habitude de lancer son sabre afin de faire le maximum de dégâts sur la cible fuyante.','Sabre Laser de l\'Inquisiteur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/sabreinquisiteurava.png');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (510,'Les Shikkars étaient des dagues avec la lame en verre. Ils étaient façonnés par des maîtres verriers au moyen de la Force. Ils pouvaient être considérés comme des œuvres d\'art en même temps qu\'armes. Ces lames étaient à usage unique. Quand le Shikkar rentrait dans le corps de la victime, la lame se brisait en éclats donnant une mort lente et particulièrement douloureuse. La majorité des Sith de la Tribu Perdue considérait l\'assassinat par Shikkar comme insultant. Il était donc réservé à des vengeances ou des tentatives d\'élimination des opposants dans la lutte pour le pouvoir. Parmi les utilisateurs connus de Shikkars dans la Tribu Perdue des Sith, on pouvait noter Vestara Khai. Elle utilisa le sien contre le maître Sith Yuvar Xal qui voulait prendre la place de la maitresse de Vestara, Dame Rhéa, au cours de la mission contre les Skywalker dans la Gueule.','Shikkar',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/shikkar_avv6.jpg'),
 (511,'Le canon anti-véhicule AV-7 était un canon d’artillerie lourd utilisé par la République pendant la Guerre des Clones. Basé sur un système à répulsion, l’AV-7 fabriqué par Taim & Bak pouvait détruire d’un seul tir des véhicules blindés comme par exemple les Chars d’Assaut Blindés Séparatistes. Avec une stabilité et une précision incomparables grâce à ses quatre pieds, l’AV-7 était manœuvré par un clone se situant sur le côté droit de l’appareil.','AV-7',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/av7_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (512,'Parmi les blasters à répétition les plus puissants dans l’arsenal impérial, le E-WEB (Emplacement Weapon, Heavy Blaster) de BlasTech est sans doute le plus efficace contre l’infanterie et les véhicules ennemis. Son utilisation première est de protéger les avant-postes contre les invasions. L’arme est composée du blaster et de son trépied. Sa portée optimale est de 200 mètres mais il peut également atteindre des cibles situées à 500 mètres. Il peut aussi transpercer tout ce qui est coque de véhicules au sol, airspeeders et petits vaisseaux. Les troupes impériales l’utilisèrent sur la planète Hoth, et endommagèrent avec quelques pièces du Faucon Millénium, comme l’hyperdrive. De même, sa puissance endommagea les coques des snowspeeders employés par les Rebelles sur la planète glacière. Il faut être au minimum deux personnes pour manier cette arme : un tireur et un technicien pour ajuster le générateur de puissance Eksoan Class-4T3, mais également pour assurer la communication. Ce générateur est très fragile malgré son système de refroidissement Cryocooler Gk3. La surchauffe peut arriver très rapidement, ce qui peut amener une mini explosion. Le second membre doit donc faire très attention à cette phase d’ajustement, afin de ne pas rendre le système obsolète. Les deux soldats reçoivent un entraînement très intensif, qui permet éventuellement à un seul soldat de se servir du E-WEB assez correctement, mais tout en réduisant son efficacité. Il doit choisir le mode pré-calibré, ce qui réduit considérablement la cadence de tir, mais permet de maintenir le générateur à une chaleur constante.  La puissance est transmise grâce au conduit de trois mètres reliant le canon à la base tripodale BlasTech TR-62. Le E-WEB possède également un système de communication avancé et de longue portée, ainsi qu’un module de cryptage pour permettre les communications sécurisées entre unités. Le contrôle de feu automatisé, ainsi que le système de visée permettent l’utilisation du E-WEB dans des endroits sombres et même durant la nuit. Cependant, toutes ces qualités sont ternies par la durée d’installation. En effet, il faut environ 15 minutes pour déployer l’arme, calibrer le générateur de puissance, et configurer le système de visée. Si les deux membres utilisent l’arme avant que tout soit prêt, cela peut la mettre hors-service. Quelques troupes impériales avaient eu la bonne idée de « pré-charger » le générateur pour aller plus vite, mais cela menait à une surchauffe plus rapide. Après utilisation, l’arme doit être démontée et déplacée, mais cela ne prend pas plus de 5 minutes de remonter le dispositif. La rotation du E-WEB est de 360 degrés, ce qui lui donne une très bonne réputation chez les tacticiens.','Blaster à Répétition E-WEB',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/blaster_eweb_avv6.jpg'),
 (513,'Le Canon Sonique LR1K, aussi appelé Canon Sonique Géonosien ou bien encore Plate-forme de Défense Sonique Géonosienne, et une arme développée par la Gordarl Weaponsmiths pendant la Guerre des Clones. Leaders en armes soniques, les géonosiens utilisèrent la même technologie que le blaster sonique : une onde sonique est créé à l’aide d’oscillateurs internes et est retenue à l’aide d’une bulle plasmique explosant et libérant l’onde de choc au premier obstacle. D’une portée optimale de 20 mètres, sa puissance en faisait une redoutable arme anti-infanterie et anti-véhicules légers. Principalement utilisée avant la Guerre des Clones dans l’arène de Petranaki ainsi que dans certaines batailles inter-ruches, les géonosiens augmentèrent sa production peu avant le début du conflit. Malgré un système de tir automatique, le LR1K avait le plus souvent besoin d’un ou deux opérateurs. Son deuxième point faible est son ratio, avec un chargement d\'onde et rechargement plutôt long, il ne pouvait pas être emmené en première ligne, d\'où son utilisation comme point défensif.','Canon sonique LR1K',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/lr1k_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (514,'Arme Sith ayant pour objectif la destruction pure et simple à grande échelle, la Faucheuse Noire fut créée près de cinq millenaires avant la Bataille de Yavin par Ulic Qel-Droma, quand il faisait encore partie des Seigneurs Noirs. Si elle était entièrement automatisée, l\'invention de l\'ancien Jedi ne pouvait pourtant fonctionner sans le Moissonneur de Force, qui, comme son nom l\'indiquait, était chargé de l\'alimenter en aspirant l\'energie de quiconque se trouvait sur son passage. Toutefois, lorsque Qel-Droma souhaita se repentir de ses crimes pour trouver la rédemption, l\'une des premières choses qu\'il fit fut de désactiver la Faucheuse Noire et d\'en éloigner ce qui lui faisait office de circuit d\'alimentation, et personne n\'en entendit alors plus parler. Ce fut cependant sans compter l\'esprit retors du Seigneur Noir Dark Sidious, qui, vingt-deux ans avant la Bataille de Yavin, alors qu\'il venait de déclencher la Guerre des Clones, chargea Dark Tyranus, l\'autre moitié de l\'Ordre Sith de l\'époque, de retrouver l\'antique arme de destruction massive. Motivé par l\'envie de porter un coup à la République et aux Jedi, celui qui était publiquement connu comme étant le Comte Dooku, leader de la Confédération des Systèmes Indépendants, parvint alors à mettre la main sur le Moissonneur de Force sur la planète Raxus Prime, avant de récupèrer la Faucheuse Noire sur Thule. S\'il réussit à activer l\'arme Sith, avant de pouvoir l\'utiliser, Tyranus trouva toutefois sur sa route le Padawan Anakin Skywalker, qui avait découvert le moyen de la neutraliser dans le tombeau d\'Ulic Qel-Droma. Pièce par pièce, le Jedi mit ainsi fin à la menace que l\'antique artefact représentait pour la Galaxie, et lorsque le Moissonneur de Force fut détruit, la Faucheuse Noire fut anéantie pour toujours.','Faucheuse Noire',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/faucheuse_noire_avv6.jpg'),
 (515,'Le super-laser impérial était l’arme la plus puissante et la plus mortelle que l’Empire Galactique ait possédée. Grâce à elle, l’Empereur Palpatine souhaitait non seulement soumettre tous les mondes de la galaxie, mais aussi en détruire afin de terroriser les peuples et les rallier à sa cause. Le super-laser fut une de ses forces de dissuasion les plus efficaces. De l’extérieur, le super-laser apparaissait comme une vaste surface circulaire d’une dizaine de kilomètres de diamètre et légèrement renfoncée dans l’immense station sphérique. Sur son contour, délimité par le cristal du laser, on pouvait distinguer huit cristaux répartis de façon équidistante. Ces cristaux se trouvaient à l’extrémité de puits lourdement armés qui se prolongeaient jusqu’au réacteur à hypermatière d’où l’énergie était puisée. Ce système permettait de générer huit faisceaux d’une puissance remarquables qui étaient ensuite redirigés vers le centre grâce à un champ focalisant. Ce dernier était une zone située au centre du disque. On y trouvait plus précisément la lentille focalisante, à l’intérieur de laquelle apparaissait le cristal d’amplification qui était le centre même du disque. Celui-ci, à l’aide du champ focalisant, était capable de fusionner les huit faisceaux précédemment cités afin de créer un rayon unique, rectiligne et surpuissant. Il pouvait permettre ainsi la destruction totale d’une planète, mais également de la ravager en grande partie en lui attribuant des salves lasers modérées.','Super-Laser Impérial',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/superlaser_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (516,'Le Yaret-Kor, plus communément appelé canon à plasma, est un composant caractéristique des vaisseaux spatiaux et des véhicules Yuuzhan Vong. Ces excroissances issues de la chair du corail yorik projettent de grosses gouttes de plasma (produites par mise en fusion de roche ou de matériaux massifs inertes) visant à brûler l’ennemi. La taille des canons et des gouttes de plasma dépendent du type de vaisseau. Il existe des Yaret-Kor pour les analogues de motojet autant que pour les grands croiseurs et les vaisseaux-mondes. Les plus gros Yaret-Kor sont capables de cracher du plasma en continu. La taille élevée de ces plus gros Yaret-Kor en fait parfois de bien piètres armes contre la chasse ennemie. Le Yaret-Kor est autonome : il peut se guérir lui-même et n\'a besoin d\'aucune source d’énergie. Il se rassasie en consommant différents matériaux, ôtant ainsi tout problème de fourniture de carburant à des installations dédiées. Des variantes de canons ont été observées : certains ressemblent à des cornes tandis que d’autres ressemblent à des trous dans la coque en corail yorik. Quand le plasma atteint sa cible, il la fait brûler de l’intérieur ce qui permet de détruire même les plaques les plus épaisses de transparacier.  ','Yaret-Kor',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/yaret_kor_avv6.jpg'),
 (517,'L’anguille plasma est l’équivalent d’une grenade. L’anguille est presque aussi longue qu’un bâton amphi et s’enroule autour du bras de son utilisateur lorsqu’elle n’est pas utilisée. Le guerrier lance alors l’anguille qui se rigidifie pendant que sa tête s’emplit d’énergie plasma : lorsque la tête de l’anguille atteint sa cible, elle explose avec la puissance d’un détonateur thermique.','Anguille plasma',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (518,'Le bisulfate de baradium était un explosif utilisé sur Cynda, la lune de la planète Gorse, afin d\'extraire du minerai, le thorilide, de la lune. Il était surnommé \'baby\' par les mineurs.  De par sa nature très instable, il causait l\'explosion de nombreux vaisseaux qui le transportaient.','Bisulfate de baradium',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (519,'La bombe à electro-protons fut une arme terrible utilisée par la République lors de la Guerre des Clones. Spécialement ciblée sur les machines et n’importe quel instrument électronique, cette bombe à ions avait été créée spécifiquement pour causer le plus de dégâts possibles aux armées de droïdes des Séparatistes. Larguée depuis un bombardier, son effet était le même qu’une grenade EMP mais à une échelle tout autre. Au moment de l’impact, l’engin provoquait une explosion très puissante, dégageant un souffle dévastateur sur une centaine de mètres. Quelques secondes plus tard, une deuxième explosion éclatait, créant une onde électromagnétique s’étalant au delà d’un kilomètre, endommageant ou détruisant tout appareil électronique.','Bombe à Electroprotons',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/bombe_proton_avv6.jpg'),
 (520,'Le destructeur organique était une arme créée par le Techno-Syndicat capable de détruire toute trace organique une fois enclenchée, grâce à ses tentacules d\'énergie qui localisaient puis réduisaient en poudre toute forme de vie.  En l\'an -20, vers la fin de la Guerre des Clones, Wat Tambor utilisa l\'arme sur un Potelec, un natif de Skako Minor, pour montrer à Anakin Skywalker, Rex et l\'escouade Bad Batch ce qui leur arriverait s\'ils ne se rendaient pas. Ceux-ci s\'étaient en effet infiltrés dans la ville de Purkell afin de secourir le clone Echo. Les républicains n\'abdiquèrent pas, et Tambor envoya le destructeur organique dans la pièce où ils se trouvaient. Le Jedi et les clones réussirent cependant à y échapper en fuyant via un conduit d\'aération.','Destructeur organique',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/destructeur_orga_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (521,'Dweebit est le nom rassemblant plusieurs variétés de petits scarabées de couleur brun-rougeâtre développées par les Yuuzhan Vong. Les scarabées dweebits sont utilisés pour modifier l\'environnement d\'une planète selon les besoins des Vong. Sur la planète Belkadan, un essaim de dweebits a été employé pour rendre l\'environnement inhabitable pour les indigènes. Cette action fournit une couverture à l\'invasion de la Garde Prétorienne Vong sur Helska IV et transforma la planète en chantier naval utilisé pour fabriquer des coraux skippers et des villips. Les dweebits s\'installent en petits groupes dans la racine des plantes et libèrent des substances chimiques dans le sol. Les plantes absorbent ces substances et les relâchent à leur tour dans l\'atmosphère pendant la photosynthèse. Comme la plupart des insectes, les dweebits se reproduisent vite et se propagent à travers l\'écosystème de la planète.','Dweebit',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (522,'FG36 est le nom qui fut donné à un virus créé en 22 avant la Bataille de Yavin par la docteur Ovolot Qail Uthan. Le FG36 est une version modifiée du Nebellia (un virus bénin provoquant des troubles respiratoires et des diarrhées) visant une protéine fixée à l\'ADN et capable de provoquer la mort par hémorragie interne et paralysie musculaire. Ce virus était à la base destiné à l\'éradication des clones en visant spécifiquement leur ADN, celui-ci étant identique chez chaque soldat et issu du chasseur de primes Jango Fett. Cependant le docteur Uthan fut enlevée par un groupe de clones, l\'escouade Omega, avant d\'avoir terminé sa création. Le FG36 n\'en était alors qu\'à un stade précoce de son développement et la spécificité contre l\'ADN des clones n\'avait pas encore été mise au point. L’arrêt des recherches posait donc un grave problème : le virus étant non-spécifique, celui-ci était capable d\'affecter n\'importe quel être humain. Malheureusement, l\'Empereur s\'appropria les échantillons et fit de Gibad, la planète d\'origine d\'Uthan, un exemple du sort qu\'il réservait à celles et ceux qui osaient encore s\'opposer à son pouvoir. Devant les Holonews, le docteur vit la population entièrement décimée par le virus. Le sentiment de culpabilité qu\'elle éprouva, et l\'affection qu\'elle portait alors aux soldats mêmes qui l\'avaient capturée, la poussèrent à développer un traitement efficace qu\'ils dispersèrent sur Mandalore, sa planète d\'accueil. Le vaccin était en fait aussi un virus provoquant une mutation non délétère du gène de la protéine ciblée par le FG36, celle-ci n\'aura donc plus la même forme et l\'arme biologique n\'aura donc plus d\'effet.','FG36',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/fg36_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (523,'Les galets magma étaient utilisés contre les droïdes et les armures en lieu et place du bâton amphi. Ils sont l’une des rares armes Yuuzhan Vong inertes. Le galet magma n’est rien de plus qu’un éclat de roche recouvert d’un manteau de magma très similaire aux projectiles envoyés par les Yaret-Kor. Lancés comme des grenades, les coquillages explosaient en éclaboussant de magma la cible. Ils ne sont toutefois efficaces que sur des armures corporelles et des véhicules légers.','Galet magma',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/galet_magma_avv6.jpg'),
 (524,'La gelée blorash est une création unique en son genre puisqu\'elle est vivante. C\'est une substance visqueuse qui est sphérique quand elle est jetée vers sa cible et s\'étale lors de l\'impact. La gelée se contracte pour emprisonner sa cible qui est alors irrémédiablement empêtrée dans la substance. Plus la victime se débat pour se détacher, plus la gelée resserre sa prise sur son adversaire. Il existe quelques substances capables de faire lâcher prise à la gelée, et même le sabre laser des Jedi coupant en deux la gelée n’est pas la meilleure solution : la gelée est alors divisée en deux nouvelles gelées, ce qui constitue autant d’adversaire supplémentaire pour l’assailli.','Gelée Blorash',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/gelee_blorash_avv6.jpg'),
 (525,'Le huun est une créature originaire de la galaxie natale des Yuuzhan Vong. Il libère une neurotoxine mortelle dès l\'impact. Bien que la toxine soit extrêmement meurtrière pour un Yuuzhan Vong, nombreux sont les modeleurs qui ont été immunisés contre ses effets pendant leurs efforts d\'amélioration de l\'arme.','Huun',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (526,'Les insectes-bombes sont des projectiles biologiques parents des insectes-cogneurs puisqu’ils sont eux aussi une modification des abeilles-étincelle. Mais contrairement aux insectes-cogneurs et aux insectes-rasoirs, l’insecte-bombe était l’analogue Yuuzhan Vong du missile guidé. Au moment d’entrer en contact avec sa cible, l’insecte explose en envoyant valser la victime dans les airs, lui causant de sévères brûlures et parfois même brisant son armure. Un humain pris dans une explosion sans armure avait peu de chance d’y survivre.','Insecte-bombe',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/insecte_bombe_avv6.jpg'),
 (527,'Les insectes-éclairs sont des insectes rouge écarlates utilisés par les guerriers Yuuzhan Vong pour représenter une bataille en trois dimensions. Au commandement d’un yammosk, ils sont capables de s’éclairer plus ou moins intensément pour représenter les vaisseaux Yuuzhan Vong et les vaisseaux ennemis. Des nuances subtiles dans la couleur, le bourdonnement et même l’odeur des insectes-éclairs fournissent au commandant Yuuzhan Vong la disposition en temps réel et l’état des vaisseaux qu’ils représentent. Ils sont fréquemment associés à un trône cognitif.','Insecte-éclair',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (528,'Les insectes-flashs sont une variante des insectes-bombes. Tels des grenades flashs, ils émettent une lumière intense et une explosion sonique qui permet de dérouter et d’aveugler leurs ennemis. Les Yuuzhan Vong étant immunisés contre leur effet, ils s’en servaient pour déloger leurs ennemis dans l’obscurité.','Insecte-flash',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (529,'Les insectes-piques sont des insectes volants qui vivaient en nids dans la galaxie Yuuzhan Vong. Ils sont utilisés dans la fabrication de pièges anti-swoop.','Insecte-pique',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (530,'Malgré leur similitude physique avec les insectes-cogneurs, les insectes-rasoirs accomplissent un objectif tout à fait différent. Alors que les insectes-cogneurs sont conçus pour frapper la cible, les insectes-rasoirs vont la déchiqueter avec leur coquille acérée. Les coquilles d’insectes-rasoirs ne sont pas seulement tranchantes comme une lame, elles sont aussi très résistantes et peuvent traverser un grand nombre de substances. Comme l’insecte-cogneur, l’insecte-rasoir retournera à son propriétaire s’il manque sa cible. Même s’il est facile de les tuer en les piétinant, il est plus difficile de s’en échapper quand ils sont lancés en grandes quantités.','Insecte-rasoir',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/razorbug_avv6.jpg'),
 (531,'Des basals dovin ont été modifiés pour qu’ils puissent agir à distance quand ils se déplacent librement dans l’espace. La carapace dans laquelle ils évoluent rappelle celle d’un corail skipper. L’unique différence entre les deux est que celle des basals dovin est recouverte d’une armure noire lisse. Au premier abord, cette carapace lui confère l’avantage de ne pas détecter les anomalies gravifiques créées par le basal dovin caché à l’intérieur. Lorsqu’un ennemi s’approche trop, le basal dovin l’aspire soudainement dans un trou noir.','Mine gravifique',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (532,'Le nang hul, ou insecte-cogneur, est un type d’insecte provenant de la galaxie des Yuuzhan Vong employé en tant que projectile. Comme la plupart des insectes projectiles, les nang hul sont modelés à partir des abeilles-éclairs et ressemblent à un scarabée muni de courtes pattes aiguisées et de petites ailes au son vrombissant lorsqu’ils sont en vol. Le bruit sourd accompagnant l’impact avec la cible leur a donné le nom d’insecte-cogneur. L’utilisateur lance l’insecte-cogneur sur sa cible et si l’insecte la manque, il reviendra directement dans la main de celui qui l’a lancé. Pour donner plus de puissance aux projectiles, les guerriers Yuuzhan Vong utilisent parfois un lanceur de nang hul.','Nang-hul',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/nang_hul_avv6.jpg'),
 (533,'Les nano-droïdes étaient une forme de technologie microscopique, et étaient utilisés comme explosifs. Durant la Guerre des Clones, en l\'an -20, Letta Turmond nourrit son mari, Jackar Bowmani, avec des nano-droïdes, le transformant ainsi en bombe vivante. L\'explosion eut lieu au Temple Jedi, tuant de nombreuses personnes. Lors de leur enquête, les Jedi Anakin Skywalker et Ahsoka Tano découvrirent l\'existence des nano-droïdes, et remontèrent leur piste jusqu\'à chez Letta. Plus tard, Ahsoka découvrit des caisses contenant des nano-droïdes dans les bas-fonds de Coruscant.','Nano-droïdes',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/nanodroides_avv6.jpg'),
 (534,'Le saberdard est un projectile de petite taille mais redoutable. Ce n\'est en effet qu\'une petite fléchette en apparence, ne mesurant pas plus de 5 centimètres. Le saberdard est muni de trois ailerons stabilisateurs, permettant la trajectoire rectiligne parfaite du projectile. Au bout de chaque aileron se trouve un éperon d’ancrage afin que le projectile ait une incursion nette et précise dans la peau de la victime. En son centre se trouve le réservoir de poison, muni d’une aiguille d’injection pour laisser le poison se diffuser instantanément. Obi-Wan vit ce projectile pour la première fois lorsqu’un mystérieux assassin l’utilisa sur la Clawdite Zam Wesell. Il n\'avait jamais vu un projectile de cette taille auparavant. Ce n’était que le point de départ de sa longue enquête, qui le fit remonter ensuite jusqu’à Jango Fett. Même les droïdes du temple Jedi, à qui on présenta ce projectile, ne réussirent pas à analyser la provenance du projectile. Ce fut un vieil ami dénommé Dexter Jettster, chef du restaurant Chez Dexter sur Coruscant, qui lui indiqua la provenance Kaminoane de l’arme. Dexter avoua qu’il n’en avait pas vu beaucoup durant toute sa carrière, mais il n\'eut aucune hésitation dans son jugement. Selon lui, les « entailles sur le côté » étaient typiques de Kamino, chose que les droïdes ne pouvaient pas voir, eux. Cependant, le saberdard resta une arme typique mais pas exceptionnelle. Les fléchettes empoisonnées ne se faisaient plus rares dans la galaxie et, selon le type de la fléchette et du projectile, on arrivait facilement à retrouver la provenance de l’arme, donc de l’assassin. Le saberdard avait la préférence de Jango Fett pour plusieurs raisons : Elle garantissait un décès de la victime très rapide et garanti. Selon la nature du poison, la cible atteinte n\'avait même pas le temps de se rendre compte du tireur ou de l\'injection d\'un quelconque fluide. Ainsi, pour protéger son identité, Jango Fett n\'hésita pas à utiliser cette arme pour tuer Zam Wesell, avant qu\'elle ne parle.','Saberdard',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/saberdard_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (535,'Couramment utilisés dans les parties de chasse Yuuzhan Vong, les scarabées-filets permettent une capture facile avec le minimum d\'efforts. Quand on les lâche, ils tissent des fibres formant une toile quasiment incassable. Cette toile sert de filet et est assez résistante pour attraper tout ce qui la touche. Les insectes sont des ouvriers tenaces, utilisant les cellules de n\'importe quel être vivant bloqué dans le filet pour tisser de nouvelles fibres. Ce processus peut être douloureux mais il n\'est pas mortel.','Scarabées-filets',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (536,'La spore Bo’tous est une variante encore plus meurtrière de la maladie des spores Coomb dont elle a la même composition. Quand elles sont employées comme des armes, les spores bo’tous sont transportées dans les poumons de l\'utilisateur jusqu\'à ce qu\'elles soient prêtes à être libérées sur la victime naïve. Lors d\'une longue expiration, les spores sont libérées avec d\'horribles conséquences. Si elles sont libérézs dans une zone fermée, les spores prolifèrent rapidement par inhalation. Le visage des victimes devient bleu ou vert pâle tandis que les spores mâchent les organes pour arriver au cerveau. Des spasmes parcourent les membres et les appendices de la victime et leur peau suinte parfois à cause des capillaires éclatés. Les hémorragies internes font ensuite jaillir le sang par la bouche, le nez et les yeux. Une fois la victime assassinée, les spores meurent et ressemblent à des puces phosphorescentes vidées de leur contenu.','Spore Bo\'tous',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (537,'Les spores brollup – tout comme les spores coomb ou tegnest ainsi qu’une douzaine d’autres – sont l’une des créations chimiques de Nom Anor. La création de telles spores est à la fois un passe-temps et un objectif pour l’Exécuteur : concevoir des armes pour détruire les Jeedai.','Spore Brollup',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (538,'Les spores Coomb sont une espèce de virus créée par le génie génétique de Nom Anor. La création des spores Coomb ainsi que des spores Brollup, Tegnest et une douzaine d\'autres sortes de virus font partie intégrante du projet de Nom Anor. Anor veut devenir Haut Préfet et il espère que ces spores l\'aideront à atteindre ce rang puisque ce sont des armes conçues pour détruire les Jedi. Chez les êtres normaux, le virus démolit la structure moléculaire de la victime et entraîne une mort extrêmement douloureuse. Puisque les spores Coomb meurent avec la victime, la maladie n\'est pas contagieuse. Quand l\'Exécuteur inocula le virus à plusieurs victimes, toutes décédèrent rapidement excepté le Chevalier Jedi Mara Jade ainsi qu\'un autre survivant qui restera infirme toute sa vie. Actuellement, il n\'existe aucun remède au virus des spores Coomb.','Spore Coomb',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (539,'Les spores Tegnest – tout comme les spores Coomb ou Brollup ainsi qu’une douzaine d’autres – sont l’une des créations chimiques de Nom Anor. La création de telles spores est à la fois un passe-temps et un objectif pour l’Exécuteur : concevoir des armes pour détruire les Jeedai.','Spore Tegnest',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (540,'On les croyait d\'abord être nés d\'une mutation due à la pollution constante sur Duro mais les \'yeux blancs\' se révélèrent être une création des Yuuzhan Vong. Découverts dans le campement Trente-Deux de Duro, ces créatures semblables à des vers furent d\'abord considérés inoffensifs. Chacun de ces vers gris possède neuf segments avec une paire de pattes par segment. Leurs grands yeux noirs surveillaient les alentours tandis qu\'ils dévoraient le synthéplast avec leur bouche disproportionnée. Au grand effroi des habitants du dôme, les vers mutèrent bien vite en papillons beaucoup plus grands que leur état larvaire. La taille de leurs mandibules déjà énormes augmenta jusqu\'à atteindre le double de leur taille précédente. A la place des antennes, ces créatures portent des cornes. Sur chacune de leurs ailes noires se trouvent des taches blanches ressemblant à des yeux, ce qui leur valut le surnom d\'\'yeux blancs\'. Les réfugiés furent obligés de fuir le dôme car les insectes ailés attaquèrent le synthéplast et exposèrent le dôme à l\'atmosphère toxique de Duro.','Ver Naotebe',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (541,'Le virus de l\'ombre bleue était un virus qui a décimé la galaxie plusieurs générations avant le temps de l’Empire. Sa capacité à toucher toutes les espèces et son taux de mortalité de près de 100% en firent l’un des fléaux les plus mortels de l’Histoire de l’Ancienne République. Il tira son nom du teint bleu que prenait la peau des victimes infectées. Le virus fut finalement annihilé mais malgré le temps, beaucoup de gens n’ont pas oublié le virus.','Virus l\'Ombre Bleue',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/virus_ombre_bleue_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (542,'Les yanskacs sont des créatures utilisées par les membres de la caste des Guerriers qui les utilisent comme arme. Des épines dorsales de huit centimètres de long courent sur la colonne vertébrale de la créature qui se termine en une queue qui contient un neuropoison douloureux mais pas forcément fatal. Ces animaux sont également une source de nourriture dans la caste des Guerriers et des Ouvriers. Lorsqu\'un Yuuzhan Vong souhaite en manger un, il doit plonger la main dans le réservoir où ils sont contenus en le saisissant en dessous de la queue de manière à éviter le neuropoison mais en permettant au yanskac de planter ses épines dans le Yuuzhan Vong. Il est ensuite dépecé vivant et jeté dans le brasier.','Yanskac',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (543,'Du nom d’un redoutable prédateur de Kashyyyk, cette armure est tout aussi redoutable pour la cible d’un commando. D’un poids total de 20Kg, l’armure Katarn est révolutionnaire grâce à ses plaques plus résistantes que le plastoïd des armures standards et par la génération d’un bouclier. Ainsi, l’armure offre une protection optimale au soldat, qui peut encaisser plusieurs tirs sans subir de dommages physiques. De par les propriétés chimiques exceptionnelles des plaques, le bouclier se recharge au bout d’un certain temps. Les plaques, dont la couleur de base s’approche du gris clair, sont apposées à une combinaison thermique noire capable de résister au vide et à la gravité zéro. Cette capacité permet aux commandos de s’infiltrer dans un vaisseau directement depuis l’espace ou de survivre à une dépressurisation soudaine. Au cours de la Guerre des Clones, les recommandations des commandos viendront améliorer encore cette armure déjà hors normes : réserve d’oxygène pour infiltration sous-marine, boucliers permettant un camouflage optique et une invisibilité aux senseurs… Certaines escouades différencient même leurs armures par des couleurs reconnaissables comme le noir pour l’escouade Omega. Le commando dispose également d’une vibrolame rétractable au niveau du poignet, très efficace lors d’un combat au corps à corps ou d’un assassinat silencieux. Le pack de survie est équipé en fonction des paramètres de la mission. Il peut ainsi accueillir les rations, le nécessaire d’hygiène, des cordages, un parachute, des réserves d’oxygène, des munitions supplémentaires… Outre les paramètres de combat, l’armure Katarn possède un dispositif d’injection intra-veineuse directe de bacta à partir de certaines plaques de l’armure (principalement thoracique et dorsale). Lorsqu’il est blessé, le commando utilise une borne de bacta ou une de ses réserves qui ont une action directe sur la zone lésée. Il est ainsi beaucoup plus autonome et robuste qu’une unité standard. Un injecteur de bacta rapide sera utilisé au niveau de la plaque dorsale lorsqu’un membre de l’escouade est gravement blessé ou inconscient. Enfin, le casque est sans équivoque l’élément indispensable au commando lors d’une opération. Grâce à l’ATH, il affiche en temps réel les données tactiques nécessaires à la coordination de l’escouade et à l’exécution des manœuvres. La visière en forme de T est capable d’afficher de nombreuses données essentielles et de permettre au commando d’opérer dans toutes les conditions de visibilité. Celle-ci possède un système de réparation automatique lorsqu’elle est obstruée ou endommagée, permettant au clone de ne pas se détourner de l’action en cours. Le système de communication incorporé permet de relayer les messages sur de très larges fréquences et sur les longues distances. Chaque canal est crypté et sélectionnable selon les destinataires, que ce soit le conseiller responsable de la mission, un ou plusieurs membres de l’escouade ou encore un autochtone lorsque la communication est sur un canal externe. Enfin, le casque permet au commando d’être alerté de tout mouvement suspect, ceci même lorsqu’il ne le porte pas.','Armure commando Katarn',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/armure_katarn_avv6.jpg'),
 (544,'Ce serpent de la terreur aux proportions gigantesques fut aperçu pour la première fois au-dessus d\'Ord Mantell, quand un vaisseau de guerre Yuuzhan Vong attaqua la planète. L\'horrible créature sortit par un sombre orifice de la proue du vaisseau et s\'attacha à la Roue du Jubilé, une station orbitale. Le véritable nom de cette créature étant inconnu, un surnom lui a été donné en se basant sur sa méthode d\'attaque. Après avoir mordu dans la station, il aspira les victimes pour les emmener dans le vaisseau de guerre en utilisant sa gueule géante. Le lieu de stationnement du vaisseau de guerre est actuellement recherché.','Bouche aspirante',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/bouche_aspirante_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (545,'Les déflecteurs Colicoid 49-v99 étaient des générateurs de boucliers déflecteurs de type militaire, développés par les chantiers navals de Kuat, et utilisés par l\'Empire. Environ quatre ans avant la Bataille de Yavin, le groupe de rebelles de Kanan Jarrus et Hera Syndulla vola quelques générateurs présents sur la planète Lothal, avant d\'échanger trois de ces générateurs à Lando Calrissian contre son aide pour quitter la planète.','Déflecteur Colicoid 49-v99',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/deflecteur_colicoid_avv6.jpg'),
 (546,'Les épaulettes de Steng – ainsi nommées après le premier Maître de Guerre Steng – sont élaborées à partir d’os de Sgauru. Les guerriers les plus méritants se voient attribuer l’honneur de subir une greffe de ses petites griffes rétractables et sortables à souhait. Insérées au niveau des épaules, les épaulettes pouvaient se révéler fatales pour le guerrier qui subissait la greffe tant leur emplacement est dangereux. Cette arme faisait partie intégrante du développement des guerriers anti-Jedi appelés Massacreurs, développés à la fin de la guerre.','Epaulettes de Steng',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (547,'La fronde laser est une arme non mortelle se portant au poignet. Cette fronde était capable de catapulter tout sortes d\'objets, mais également une boule d\'énergie. C\'était l\'arme favorite d\'Ezra Bridger, qu\'il utilisait très fréquemment contre les troupes impériales.','Fronde Laser',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/frondelaserava.png');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (548,'Les Gardiens de Pierre étaient des sentinelles postées sur la lune de Bardossa Stix. Vingt ans avant la Bataille de Yavin, alors que Mace Windu et Jar Jar se trouvaient sur la lune pour sauver la Reine Julia, capturée par le Culte de Frangawl, le Gungan les actionna par mégarde. Le Jedi réussit à s\'en débarrasser en retournant leurs armes contre eux.','Gardien de Pierre',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/gardiens_pierre_avv6.jpg'),
 (549,'Le grimage Nuun est une version modifiée du grimage ooglith composé de bactéries photo-sensitives qui reflètent le paysage alentour, procurant aux Guerriers qui la portent un camouflage quasiment indétectable. Ces créatures sont réservées à l’usage des Chasseurs Yuuzhan Vong, des guerriers d’élite.','Grimage de Nuun',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (550,'Le grimage ooglith est une créature charnue et membraneuse, conçue pour camoufler son hôte. S’attachant à son hôte par ses pores, le grimage rend l’utilisateur indifférenciable d’un être humain. La narine gauche est le point de libération du grimage ooglith et quand on appuie dessus, la créature retire lentement ses milliers de tentacules des pores de l’hôte. Le grimage ooglith a une peur intense du démasqueur, une créature vorace utilisée pour révéler des individus camouflés. Le masque ooglith est déclinée en plusieurs sortes.','Grimage ooglith',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/grimage_ooglith_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (551,'Les jetpacks de modèle JT-12 furent construits par les Munitions Merr-Sonn et utilisés avant tout par les mandaloriens et les chasseurs de primes de la galaxie. Comme le modèle concurrent, le Z-6 des Transports Mitrinomon, l’utilisateur pouvait au choix soit l’activer pendant toute une minute, soit à raison de 20 coups de trois secondes chacun. A chacune de ses poussées, le porteur effectuait soit un bond d’une centaine de mètres en hauteur, soit une avancée de 7 mètres verticalement. Un utilisateur avec une corpulence moyenne pouvait également atteindre la vitesse de 145 km/h sur une distance maximale de 2 kilomètres. La différence avec le modèle Z-6 résidait avant tout dans la solidité et la résistance de ce dernier par rapport au JT-12. Ce modèle était également équipé de gyros permettant de manœuvrer et faire atterrir l’engin et d’un lanceur de missiles MM9.','Jetpack JT-12',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/jetpackjt12_avv6.jpg'),
 (552,'Les jetpacks de modèle Z-6 furent construits par les Transports Mitrinomon et utilisés avant tout par les mandaloriens et les chasseurs de primes de la galaxie. L’utilisateur pouvait au choix soit l’activer pendant toute une minute, soit à raison de 20 coups de trois secondes chacun. A chacune de ses poussées, le porteur effectuait soit un bond d’une centaine de mètres en hauteur, soit une avancée de 7 mètres verticalement. Un utilisateur avec une corpulence moyenne pouvait également atteindre la vitesse de 145 km/h sur une distance maximale de 2 kilomètres. Ce modèle était également équipé d’un ordinateur de ciblage, de gyros permettant de manœuvrer et faire atterrir l’engin et d’un emplacement supplémentaire permettant d’accueillir soit un grappin magnétique de 20 ou 100 mètres turbo-projeté, soit un missile à tête chercheuse anti véhicule.','Jetpack Z6',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/jetpackz6_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (553,'Les kamas, souvent appelés basiquement « jupes », étaient une ornementation associée à une armure individuelle et qui avait un double rôle. Son objectif prioritaire était la protection des cuisses contre les blasters et le schrapnels mais le kama avait aussi un rôle culturel et de rang.','Kama',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/kama_avv6.jpg'),
 (554,'Le mabugat kan est un basal dovin modifié élaboré pendant la guerre afin de brouiller les transmissions HoloNet des Forces de Défense de la Nouvelle République.','Mabugat kan',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (555,'Le Traqueur Impérial S-Thread XX-23 fut utilisé pour la première fois en l\'an -5 par l\'Inquisiteur. Développé par Sienar Fleet Systems, il était projeté depuis un vaisseau et ressemblait à un missile. Pouvant parcourir une très longue distance, il pouvait se fixer à n\'importe quel vaisseau durant une bataille et résistait au passage en hyperespace. Ainsi, le vaisseau était suivi où qu\'il aille. Lorsque l\'Inquisiteur réussit à toucher le Ghost avec cet équipement depuis son TIE Avancé v1, il fut capable de suivre le vaisseau après son passage en hyperespace. D\'ailleurs, ce fut le Phantom qui fut touché, et non le Ghost. Ainsi, Kanan et Ezra se rendirent sur Fort Anaxes à bord du Phantom, tandis que le Ghost prit une autre route, protégeant ainsi Tseebo, leur contact recherché et poursuivi par l\'Empire.','Traqueur Impérial S-thread XX-23',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/traceurxx23_ava.jpeg'),
 (556,'Le ver-poumon est l\'équivalent Yuuzhan Vong d\'une réserve d\'air. La longue créature en forme de tube s\'enroule dans le dos de l\'utilisateur et est connecté à un gnullith pour fournir de l\'oxygène dans un environnement sans air comme l\'espace. Quand on l\'emploie avec une armure Ooglith résistante au vide et un gnullith, l\'utilisateur peut travailler dans le vide pendant un certain temps.','Ver-poumon',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (557,'Formée à partir de souches diverses de crabe Vonduun, l’armure portée dans la plupart des cas par les Yuuzhan Vong est une créature vivante. Des espèces différentes produisent chaque pièce de l’armure : le pectoral, le masque et le brassard. Quand les membres de la caste guerrière montent en grade, il leur est permis de porter le brassard en crabe Vonduun. Seuls les plus haut gradés peuvent porter le masque. Il y a aussi plusieurs densités disponibles pour les coquilles de crabe Vonduun. Les guerriers de rang inférieur portent l’armure la plus courante qui est noire avec des traces argentées près des bords. Cette armure est vulnérable aux attaques répétées d\'un blaster ou à un coup rapide d’un sabre laser. Quand un guerrier monte en grade, on peut lui permettre de porter l’armure de crabe azur. Cette armure n’est perméable qu’après de nombreux assauts. La seule zone vulnérable de cette armure est le tissu mou semblable à du cuir qui recouvre les articulations du crabe Vonduun. Un objet tranchant ou un sabre laser peut pénétrer dans cette zone et blesser le porteur de l’armure. Dans le jardin xénobotanique sur Garqi, une autre faiblesse de l’armure fut mise à jour : une allergie au pollen des arbres baffor originaires d’Ithor. Ceci se révéla fatal à tous les porteurs d’armures en crabe Vonduun car les articulations grossirent et entraînèrent l’étouffement des guerriers Yuuzhan Vong. La principale source de production des arbres baffor fut perdue avec la destruction d’Ithor.','Vonduun Skerr Kyrric',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/vonduun_avv6.jpg'),
 (558,'Connu pour sa capacité à synchroniser et optimiser une force d\'invasion toute entière, le yammosk ressemble à un ver immense faisant des centaines de kilomètres de long. Il est considéré comme l\'incarnation mortelle de Yun-Yammka, le dieu de la guerre. Puisqu\'il est important de pouvoir le protéger, le yammosk est souvent enterré sous la surface d\'une planète puissamment défendue. La biotechnologie Yuuzhan Vong n\'est généralement pas consciente, mais les yammosks l\'étaient au moins partiellement. Le yammosk est une créature de taille époustouflante, avec une tête bulbeuse et des milliers de tentacules. Certaines tentacules sont très épaisses mais courtes tandis que d\'autres sont des filaments minces de plus de cent kilomètres de long. Son corps et sa queue sont allongés. Rappelant un cerveau géant, la tête du yammosk possède deux yeux noirs bulbeux entourés de nombreux autres yeux. Il a une bouche plissée pleine de dents plus une dent centrale qui est largement plus grande que les autres. Deux petits tentacules gluants sont déployés de part et d\'autre de sa bouche pour saisir ses proies. Il est dit que le premier yammosk mit des centaines d\'années pour être créé, tant les modeleurs recherchaient la perfection ultime de l\'esprit guerrier. Les fonctions télépathiques de commandement du yammosk furent déclinées pour plusieurs autres créatures Yuuzhan Vong tel le dhuryam (ou cerveau-monde), le shreeyam\'tiz ou encore la grotte de Yun Ne\'Shel. Le yammosk créait des liens avec le commandant qui l\'avait en charge afin d\'améliorer son efficacité ainsi qu\'avec son éventuelle progéniture à laquelle il transmettait tout son savoir de coordonnateur de guerre. Des esclaves étaient utilisés pour masser les tentacules des jeunes yammosks afin d\'aider leur croissance, une expérience généralement traumatisante pour les esclaves sur lesquels le yammosk n\'hésitait pas à développer ses capacités télépathiques. Gigantesque ordinateur central de commandement, le yammosk, grâce à des capacités empathiques se rapprochant de la télépathie, était capable de communiquer par manipulation de flux gravifiques. Il était relié à plusieurs basals dovin asservis qu’il considérait comme ses enfants, protégeait et coordonnait leurs actions durant la bataille. Ses aptitudes englobent tout type de coordination d\'opérations : débarquements d\'invasion, batailles de chasseurs, assauts à grande échelle. Evidemment, le yammosk sait où se trouvent les vaisseaux qu\'il coordonne grâce à leur signature gravifique, mais lorsqu\'il vient à mourir, la force d\'invasion entière peut être plongée dans le chaos. Les fortes émanations d\'ondes Psi du yammosk peuvent perturber le fonctionnement des boucliers et désorienter même le Jedi au mental le plus solide. Les vaisseaux passant trop près d\'une planète où résidait un yammosk pouvaient être tout bonnement désactivés. Car c\'est là l\'aptitude la plus étonnante du yammosk : alors que toutes les formes de vie Yuuzhan Vong sont absentes de la Force, le yammosk peut détecter les Jedi utilisant la Force lorsqu\'ils sont dans un entourage proche. Lors de la guerre, Danni Quee découvrit le moyen d\'altérer l\'efficacité du yammosk en utilisant un modulateur d\'amplification gravifique qui brouillait les communications Yuuzhan Vong. Les pilotes Yuuzhan Vong durent subir un entraînement plus rigoureux insistant sur leur indépendance lorsque les Yuuzhan Vong subirent leurs premières défaites dues à l\'invention du modulateur.','Yammosk',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/yammosk_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (559,'Les anneaux hyperspatiaux furent créés avant la Guerre des Clones afin de permettre aux appareils sans hyperdrive propre d’emprunter les voies hyperspatiales. Ils furent principalement associés aux « intercepteurs Jedi » Delta-7, Delta-7b et Eta2 durant la Guerre des Clones. Comme les chasseurs utilisant les anneaux étaient généralement trop petits pour contenir une source d’alimentation suffisante pour faire fonctionner les réacteurs hyperespace, les anneaux étaient équipés de leurs propres générateurs afin de fournir l’énergie nécessaire. Les premiers anneaux furent à l’origine équipés de seulement deux réacteurs leur fournissant une autonomie de 150.000 années lumière. Plus tard, la société TransGalMeg Industrie mit au point un nouveau type d’anneau d’hyperpropulsion contenant six réacteurs, ce qui augmenta considérablement la portée du chasseur. Mais les anneaux d’hyperpropulsion se révélèrent également être l’un des principaux points faibles des intercepteurs pendant la Guerre des Clones. Les appareils étant obligés de les abandonner durant les combats ou pour les vols atmosphériques, ceux-ci étaient alors vulnérables aux attaques ennemies. La destruction des anneaux signifiait alors l’impossibilité pour les intercepteurs de fuir en cas de danger ou de poursuivre leurs ennemis dans l’hyperespace. Les deux variantes les plus connues de l’anneau d’hyperpropulsion étaient le Syluir-31 et le Syluir-45 mis au point par TransGalMeg industrie qui furent principalement utilisés pendant la Guerre des Clones.','Anneau Hyperdrive',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/anneau_hyperdrive_avv6.jpg'),
 (560,'L\'araignée-enregistreuse était une créature Yuuzhan Vong qui poussait sur des vignes tentaculaires et avait des yeux rouges luisant. Elles étaient principalement utilisées pour produire des pellicules vivantes d\'enregistrement visuel d\'une zone donnée.','Araignée enregistreuse',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (561,'L’arksh est une créature utilisée par les Yuuzhan Vong comme source de chaleur.','Arksh',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (562,'Baptisé “l\'aspirateur” par les scientifiques de la Nouvelle République, ce quadrupède de la taille d\'un Ewok correspond très bien à son surnom. Même si cette créature n\'est que très peu connue, elle a déjà été observée en train de nettoyer une zone de ses substances dangereuses. Dans le seul événement où elle fut observée, cette créature fut employée pour retirer les cadavres des victimes de spores bo\'tous avec son long museau semblable à un tube d\'aspirateur. Nous ne savons toujours pas quels processus sont mis en jeu pour éviter à la créature d\'être infectée par les produits contaminants qu\'elle recueille.','Aspirateur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (563,'Les basals dovin sont des créatures élevées par les Yuuzhan Vong pour créer des anomalies gravitationnelles aux effets divers. Ils ont de nombreuses fonctions, la plus importante de toutes étant leur capacité à manipuler la gravité. Ces appareils vivants de manipulation de la gravité servent de répulseurs, d’hyperpropulseurs, de boucliers et parfois même d’armes. Ils peuvent même créer des mini-trous noirs qui bloquent les tirs laser et les projectiles et peuvent retirer les boucliers des vaisseaux ennemis. Il est amusant de constater qu’ils peuvent aussi masquer la voix des individus que les Yuuzhan Vong ne veulent pas entendre. L’usage le plus terrifiant des basals dovin est la tactique connue sous le nom de Noyau de Yo’gand. Avec un puissant basal dovin, la lune d’une planète peut être sortie de son orbite pour entrer en collision avec sa planète. Les basals dovin ressemblent à des cœurs rouge foncé recouverts de pointes d’un bleu profond. Quand ils arrivent à maturité, les basals dovin ont un diamètre de trois mètres. Il existe des variantes aux basals dovin classiques : une version plus grande destinée à arracher des boucliers planétaires fut développée pendant la guerre ainsi qu’une version appelée « mine gravifique » destinée au combat. Les basals dovin poussent en compagnie des yammosks. Le yammosk se lie ainsi avec les basals dovins auxquels il est assigné comme ses propres enfants, un yammosk en bonne santé produisant des basals dovin plus rapides. Les basals dovin utilisés à la propulsion d’un navire sont ainsi liés au yammosk qui dirige le vaisseau de manière à ce qu’il garde ses enfants hors de danger.','Basal dovin',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/basal_dovin_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (564,'Les bioréacteurs servent à la propulsion des vaisseaux Yuuzhan Vong, au même titre que les basals dovin.','Bioréacteur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (565,'Les capes de commandement (ou cape de guerre) sont une variété de capes vivantes portées par les membres les plus gradés de la caste des Guerriers. Les capes de commandement sont reliées au corps de l\'hôte via des griffes qui s\'incrustent dans la chair du Yuuzhan Vong après son ascension hiérarchique.','Cape de commandement',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (566,'La Caresse de Feu est un instrument de torture bizarre, élevé et utilisé par les Yuuzhan Vong. Cet appareil délivrant de la douleur sert à plonger l\'utilisateur dans une cuve de liquide chauffé à ébullition. Seuls ceux qui aspirent à la douleur pour unique but utilisent cet appareil, c\'est-à-dire les membres du sadique Domaine Shai.','Caresse de feu',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (567,'Les cerveaux de ciblage sont utilisés à bord des vaisseaux Yuuzhan Vong en tant que viseurs. De la taille d\'un poing humain, ils sont contenus dans un coquillage en forme de noisette et immergés dans une substance nutritive salée qui sent l\'eau de mer croupie. Un cerveau de ciblage pouvait être reprogrammé en altérant chirurgicalement les connexions nerveuses.','Cerveau de ciblage',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (568,'Un chilab est une créature neurale qui, une fois insérée dans les cavités du sinus, se fraie un passage jusqu\'au cerveau et interagit avec le nerf optique pour enregistrer tout ce que le sujet voit pendant un laps de temps donné.','Chilab',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (569,'Créature aquatique de la galaxie Yuuzhan Vong, le chuk’a ressemble à un mollusque et a été créé dans le but de recycler des matériaux – même inertes tels le métal et la pierre. A l\'aide de sa tête recouverte d\'une sorte de casque qui abrite une multitude de petites pinces, le chuk’a avale tout ce qui passe à sa portée. Plusieurs pinces se chargent de saisir les matériaux que l’animal digère pour les restituer sous une forme recyclée servant dans la construction de bâtiments et structures. Ils étaient très utilisés pour réaliser des tunnels et faisaient souvent l’interconnexion entre deux chambres souterraines. Lorsqu’ils n’étaient pas sollicités, il était possible de les plonger dans un sommeil profond qui nécessitait une série complexe de stimulations pour être interrompu. Un chuk’a dérangé pouvait s’avérer mortel.','Chuk\'a',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (570,'Le cloitre à endocrine est un organisme vivant utilisé dans les vaisseaux-monde. Ils utilisent des tii, mais leur fonction reste un mystère.','Cloitre à endocrine',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (571,'Les coiffures de modeleurs étaient des coiffures spéciales portées par les membres de la caste des Modeleurs Yuuzhan Vong. Constituée d\'appendices serpentins, la coiffure a une connexion rudimentaire à l\'état mental de son hôte. La coiffure pouvait prendre des formes variées, les appendices se liant généralement de manière à former une boule similaire aux turbans que portaient les intendants ou au contraire flottant à la manière de ceux des Ho\'dins.','Coiffure de modeleur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (572,'Au fil du temps et depuis leur début, les Jedi n’ont cessé de vouloir étoffer leurs rangs afin d’ouvrir les voies de la Force au plus grand nombre, tout en assurant l’avenir de leur Ordre. En effet, bien qu’ayant une longévité supérieure à la moyenne, les Jedi étaient loin d’être immortels: une mort naturelle arrivait le plus souvent quand ils ne succombaient pas au combat lors de grandes batailles. C’est ainsi que l’Ordre, à travers le Conseil Jedi, fit du recrutement de nouveaux individus sensibles à la Force une de ses grandes priorités. Cette tâche essentielle était également importante pour la Galaxie entière, et c’est pourquoi de nombreux efforts furent réalisés pour la détection de nouveaux élèves. Plusieurs procédés et appareils furent employés au cours de l’Histoire de l’Ordre pour cela, l’un d’entre eux étant le comlink Jedi, ou tout du moins une partie. Celui-ci avait en effet tous les attributs d’un comlink ordinaire à ceci près qu’il possédait une unité pour recueillir des échantillons sanguins, en plus d’un système de sécurité et d’un projecteur de silence. Ainsi, un Jedi repérant un être qu’il pensait sensible à la Force pouvait le soumettre, parfois à son insu, à une prise de sang pour confirmer ses soupçons. L’analyse sanguine se faisait ensuite par ordinateur: celui du comlink ou un autre situé à proximité vers lequel l’échantillon pouvait être transféré. L’examen consistait essentiellement à mesurer le taux de Midi-Chloriens, des organismes microscopiques présents dans toutes cellules qui servaient d’agents de communication entre une cellule, soit un organisme entier, et la Force. Ainsi, plus un individu avait un taux de Midi-Chloriens élevé, plus celui-ci était sensible et puissant dans la Force. C’est par exemple de cette manière que le Maître Qui-Gon Jinn découvrit qu’Anakin Skywalker avait un taux de Midi-Chloriens record qui dépassait même celui du Maître Jedi Yoda. Si cette analyse se révélait concluante, l’individu dont le taux de Midi-Chloriens avait été mesuré était ensuite présenté au Conseil Jedi afin qu’il passe une autre série de tests, parmi lesquels pouvait être trouvé celui du \'détecteur de Jedi\'.','Comlink Hush-98',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/comlink_hush98_avv6.jpg'),
 (573,'Les corbeilles de gestation sont utilisées dans les grashals.','Corbeille de gestation',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (574,'Cette créature fait office de sac.','Créature-poche',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (575,'Curieuses au premier abord, ces créatures-rideaux ont en fait un but très simple. Les créatures-rideaux représentent l\'équivalent Yuuzhan Vong des draps, protégeant une sculpture ou un meuble. Elles ressemblent à des carrés d\'étoffe décorée et sont souvent utilisées pour masquer les idoles des dieux Yuuzhan Vong.','Créature-rideau',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (576,'Même si le grimage Ooglith arrive à rendre son utilisateur indifférenciable des autres êtres de l\'espèce qu\'il mime, il y a pourtant quelques moyens de découvrir la véritable identité de l\'utilisateur. Le démasqueur a été conçu pour ne répondre qu\'à un utilisateur Yuuzhan Vong, le rendant inutile pour les autres espèces. Ces créatures agressives peuvent détecter les grimages Ooglith et l\'attaquent s\'ils en ont l\'occasion. Cette fureur terrifie les grimages Ooglith qui se retirent alors du porteur pour fuir leur prédateur. Le démasqueur a des dents pointues et un cou poilu et ont été décrits par certains comme ressemblant au “croisement d\'un ng’ok avec un quillarat.”','Démasqueur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (577,'Le dénoueur génétique sert à accéder aux qasha.','Dénoueur génétique',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (578,'L’Etreinte de la Douleur a plusieurs fonctions, toutes étant horriblement douloureuses. L’Etreinte de la Douleur est une véritable créature vivante qui se nourrit de la douleur des autres. L’appareil possède six appendices à triple articulation pour emprisonner l’utilisateur. Les deux membres supérieurs sont des tentacules semblables à du cuir qui encerclent les poignets tandis que les quatre autres appendices similaires bloquent les cuisses et les chevilles. Utilisée la plupart du temps sur des prisonniers, l’Etreinte est aussi utilisée par les Yuuzhan Vong pour se faire pardonner de leurs actes hérétiques ou pour s’offrir en sacrifice aux dieux. L’Etreinte de la Douleur administre une quantité constante de douleur selon les sensations du prisonnier.','Etreinte de la douleur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/etreinte_douleur_avv6.jpg'),
 (579,'La flasque-vessie permet de contenir des liquides brûlants.','Flasque-vessie',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (580,'La gelée-feu est une substance gélatineuse largement inflammable souvent utilisée par les soldats Chazrach. La gelée-feu peut également servir à la torture de prisonniers.','Gelée-feu',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (581,'Le gnullith est une créature souple en forme d’étoile se fixant sur le visage. La longue tentacule centrale descend dans la gorge et agit comme un œsophage adapté à la respiration sous-marine. Le gnullith protège aussi celui qui le porte d’une atmosphère empoisonnée. Quand la créature se met en place, l’utilisateur doit se pincer le nez pour empêcher les pinces du gnullith de refermer l’alimentation d’air. Utilisé en tandem avec une armure ooglith, le gnullith permet à l\'utilisateur de vivre sous l’eau. Une sous-espèce de gnullith possède une coquille solide qui permet de l\'utiliser dans le vide. Le gnullith peut être connecté à un ver-poumon qui remplit le rôle de bonbonne d’air éventuelle.','Gnullith',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/gnullith_avv6.jpg'),
 (582,'La gueule luur absorbe les déchets organiques des vaisseaux-mondes Yuuzhan Vong et les transforme en métal, en nutriments et en air. Ces créatures très utiles fournissent le nécessaire à la survie d’un vaisseau-monde. Certains scientifiques ont émis l’hypothèse que de telles créatures seraient capables de produire l’atmosphère d’une planète entière.','Gueule luur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (583,'Quand le Maître de Guerre Tsavong Lah fut informé du retour de Vergere, la familière de la défunte Elan, il insista pour qu\'on lui fasse subir un interrogatoire par le haar vhinic. Ces créatures sont utilisées pour interroger les prisonniers, les ennemis et les espions potentiels. Les méthodes qu\'ils utilisent au cours de l\'interrogatoire restent inconnues.','Haar vhinic',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (584,'Au même titre que l\'antique Grande Bibliothèque d\'Ossus ou les archives du Temple de Coruscant, l\'holocron était un moyen de stocker les données des Jedi. Cet objet se présentait sous la forme d\'un volume de taille réduite, pouvant tenir dans la paume d\'une main, et où étaient enregistrées de grandes quantités d\'informations transmises par des représentations holographiques de Jedi disparus. La construction, bien que gardée secrète, tournait autour de la technologie holographique et en l\'utilisation de cristaux bien spécifiques. L’holocron permettait d’acquérir ainsi des connaissances par cette interactivité. Des milliers d\'années avant l\'anéantissement de l\'Ordre par l\'Empereur Palpatine, chaque Maître Jedi possédait son propre holocron et l\'utilisait pour enregistrer des documents d\'une grande importance. Ils y racontaient des histoires, y inséraient des images d\'évènements réels, ou encore décrivaient des incidents. Les Maîtres y stockaient également leurs visions de la Force, leurs réflexions, leurs enseignements, et des techniques de formation à destination de leurs apprentis, l\'holocron étant ensuite transmis à un de ses élèves. Ils comportaient aussi des informations sur certains talents rares, comme le pouvoir d\'absorption, peu fréquent chez les Jedi. Mais n\'étant pas destinés à tout le monde, seul un individu doté de la Force pouvait les utiliser. L\'holocron détectait automatiquement son niveau d\'entraînement et pouvait ainsi bloquer les zones de connaissance au-delà de son niveau. Les Jedi stockaient des montagnes de connaissances dans ces holocrons. Des savoirs qui pouvaient très bien être néfastes pour leur utilisateur. Aussi, le gardien de l’holocron représenté par un hologramme décidait si l’individu était apte à recevoir tel ou tel enseignement. Exar Kun éprouva ainsi quelques difficultés pour atteindre de vielles connaissances Sith enregistrées par Vodo Siok Baas dans son Holocron. Des millénaires durant, les holocrons tinrent une place importante dans la vie de l\'Ordre Jedi. Mais soudainement, la méthode pour les créer disparut. La technique de construction et les outils nécessaires étant conservés dans la Grande Bibliothèque d\'Ossus, après sa destruction, on cessa peu à peu de les utiliser. Cependant, il restait quelques holocrons vierges et de nombreux Maîtres les utilisèrent pour graver leurs mémoires et leurs pensées. Ce n\'est que bien des années plus tard que seront retrouvées les techniques de création des holocrons avant que celles-ci soient de nouveau perdues lors du pillage du Temple Jedi durant la Grande Purge et l\'avènement de l\'Empire Galactique. Les Jedi n\'étaient pas les seuls à les utiliser, les Seigneurs Sith en faisaient de même, et pour une raison inconnue, la forme d\'un holocron Sith était pyramidale alors que ceux de leurs adversaires était cubique. L\'holocron le plus célèbre était le Grand Holocron, contenu dans le Temple Jedi de Coruscant. Celui-ci contenait une douzaine de faces, pour un usage simplifié. Destiné aux étudiants du Temple voulant voir les anciennes techniques Jedi, on disait que les connaissances stockées dans cet holocron n\'avaient jamais été totalement observées, et que même le Maître Yoda n\'avait jamais pu en faire le tour. D\'autres de ces artefacts étaient également confinés dans la Tour de la Première Connaissance, gardés par le vénérable Astaal Vilbum. Au fil du temps, les holocrons devinrent de plus en plus précieux, certains atteignaient même la somme d\'un million de crédits au temps de la République. Mais quand l\'Empire fut instauré, Palpatine détruisit tout ce qui concernait les Jedi et la majeure partie des holocrons disparurent, sauf ceux qu\'il conserva, comme celui du Maître Ashka Boda. Cependant, quand Luke Skywalker fonda un nouvel Ordre Jedi sur Yavin 4, il se servit des rares holocrons qu\'il avait pu récupérer pour enseigner à ses étudiants la maîtrise de la Force, tel celui de Vodo Siosk-Baas qui fut malheureusement détruit par l\'esprit d\'Exar Kun.','Holocron',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/holocron_avv6.jpg'),
 (585,'Artefact Jedi oublié et aux pouvoirs bien dissimulés, le Vor\'Na\'Tu était un antique holocron bien différent des autres... Retrouvé sur Krant par Echuu Shen-Jon, un Maître Jedi en exil volontaire sur cette planète depuis les premières semaines de la Guerre des Clones, cet objet fut bien vite convoité par le maléfique Empereur Palpatine et son sinistre séide Dark Vador, qui parvinrent malheureusement à s\'en emparer grâce à leurs troupes et à le placer sur la lune Geddes. Etant donné que Shen-Jon ne pouvait pas le laisser entre les griffes de l\'Empire, ce n\'est alors qu\'à l\'issue d\'une intervention menée par le Jedi, des soldats rebelles répondant à la Princesse Leia Organa et un bataillon de guerriers Wookiees que le Vor\'Na\'Tu revint auprès des agents du bien, pour être aussitôt partagé en quatre fragments avant qu\'Echuu ne succombe face à la lame du Seigneur Vador. Bien que n\'ayant plus vraiment d\'utilité, les morceaux dispersés de l\'artefact furent cependant réunis quelques mois après la Bataille de Yavin par Luke Skywalker et la Princesse Leia, de retour sur Geddes, désormais connue sous le nom d\'Hanoon.','Holocron Vor\'Na\'Tu',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/vornatu_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (586,'L\'implant limpin est greffé sous le bras gauche de récepteur. Sa fonction reste toutefois inconnue.','Implant limpin',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (587,'Les insectes-espions relaient les images qu’ils espionnent à celui qui les envoie.','Insecte-espion',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/insecte_espion_avv6.jpg'),
 (588,'Le k\'snell est une créature servant de vase.','K\'snell',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (589,'Le kaastoag est une créature charognard utilisée pour nettoyer le sol.','Kaastoag',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (590,'Le kavaavik est une créature souterraine modifiée par les Modeleurs. Lorsqu’un guerrier porte un kavaavik, il peut voir parfaitement dans l’obscurité.','Kavaavik',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/kavaavik_avv6.jpg'),
 (591,'Le korsk est une créature utilisée pour nettoyer le sol.','Korsk',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (592,'La plante du lambent est un buisson de couteaux verts, courts et épais dont la tige principale se termine par un bourgeon poilu rouge sang de la taille d\'un poing. Ce bourgeon rouge renferme un bulbe jaunâtre, qui protège lui-même le cristal de lambent. Ces bulbes émettent un murmure télépathique qui ne peut être ressenti que par les personnes se trouvant à proximité. Ce champ télépathique ressemble beaucoup à celui généré par le yammosk, les savants pensent que les deux créatures sont des cousins lointains. Pendant la récolte des lambents, il faut d\'abord les mettre en condition en retirant les pétales rouges et le bulbe coriace doit ensuite être coupé par un ustensile biologique particulier. Dans le bulbe se trouve le joyau de la plante : un cristal de lambent. Les Yuuzhan Vong récoltent ces cristaux et les utilisent comme lampes portables. En les configurant avec des biotes photosensibles et des décharges de valence, les lambents peuvent contrôler divers super-organismes, en particulier la catégorie des vaisseaux. En s\'accordant soi-même sur un lambent, on peut contrôler l\'intensité lumineuse avec l\'esprit. Le lambent a besoin de se nourrir à partir du silicone et des métaux qu\'il trouve au sol tant qu\'il est sous forme de plante. Après qu\'il soit récolté, il tire son énergie des champs bio-électriques des formes de vie environnantes. Le Chevalier Jedi Anakin Solo découvrit que l\'on pouvait détecter les Yuuzhan Vong dans la Force en remplaçant le cristal de convergence d\'un sabre laser par un lambent mis en condition.','Lambent',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/lambent_avv6.jpg'),
 (593,'Ces petites boules de chair et de fourrure, une fois pressées, rendent un fluide qui permet aux Yuuzhan Vong d’identifier le porteur.','Lumpen',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (594,'La main de modeleur est le nom couramment donné à une espèce de crustacés élevés par les Yuuzhan Vong. Les modeleurs reçoivent cette main lorsqu\'ils passent au rang d\'adepte. Ces créatures nagent dans l\'eau du bassin sombre qui se trouve au centre de la grotte de Yun-Ne’Shel. Pendant la cérémonie, le modeleur plonge le moignon de son bras dans le bassin. Le sang attire les crustacés et l\'un d\'entre eux s\'attache au moignon et s\'y colle définitivement. Après un instant, les terminaisons nerveuses se réparent d\'elles-mêmes et la nouvelle main devient alors utilisable. La main est couverte de bosses sensorielles, de pinces et de griffes rétractables utilisées dans le processus de modelage. Au cours de l\'ascension au rang de maître, l\'adepte modeleur va obtenir une nouvelle main. La main de maître possède huit doigts et a plus de fonctions que celle d\'un adepte. Elle possède des griffes sur les doigts qui peuvent se déployer pendant une bataille. Ces griffes acérées sont suffisamment flexibles pour s\'enrouler autour d\'une victime et peuvent même libérer un lent poison paralysant quand elles sont au contact de la victime.','Main de modeleur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (595,'Le masque d\'ombre est un dispositif de camouflage spatial utilisé notamment sur les Yorik-stronha.','Masque d\'ombre',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (596,'Au cours de leur histoire, les Seigneurs Sith disposèrent de nombreux moyens pour anéantir leurs ennemis, et l\'un des plus efficaces fut certainement le masque de torture Sith. Cet antique objet recouvrait toute la tête de son porteur, excepté les yeux, afin que la victime voie son bourreau. Le masque permettait ainsi aux Sith de briser l\'esprit de leurs prisonniers pour obtenir les informations qu\'ils désiraient, peu d\'individus pouvant résister à cet instrument de torture imprégné de l\'énergie du Coté Obscur. Cela rendait donc les Jedi tout aussi vulnérables que les autres, les empèchant d\'utiliser pleinement la Force. Au cours de la Guerre des Clones, Obi-Wan Kenobi dut subir les souffrances infligées par le masque de torture Sith au cours de sa captivité sur Rattatak, foyer de la Jedi Noire Asajj Ventress. Mais même avec l\'aide du masque, Ventress ne put obtenir de lui ce qu\'elle désirait, et le Chevalier réussit à s\'évader.','Masque de torture Sith',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/masque_torture_sith_avv6.jpg'),
 (597,'Les membranes lorqh sont l’équivalent des tours de refroidissement des grands bâtiments artificiels de la galaxie.','Membrane lorqh',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (598,'La membrane oqa permet de relier deux vaisseaux afin de transférer des passagers et du matériel. Elle est créée à partir de l’animal appelé oqa.','Membrane Oqa',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/oqa_membrane_avv6.jpg'),
 (599,'Les Yuuzhan Vong emploient cette créature pour maintenir des prisonniers et des victimes de sacrifices en captivité. Elle a exactement la même fonction que des menottes mécaniques. Cette créature simple est composée d’un corps minuscule pourvu de deux pinces courbées vers l\'extérieur. Sur un simple ordre, les pinces saisissent les poignets du prisonnier et les attachent efficacement.','Menottes vivantes',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (600,'Les mon duuls et leurs tympans surdéveloppés sont souvent associés avec les villips pour permettre aux interlocuteurs d’avoir un meilleur retour de son. Ils servent tout simplement de haut-parleurs.','Mon duul',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (601,'Le moteur à répulsion était de loin le moteur le plus utilisé de la galaxie. De taille variable, il pouvait tout aussi bien servir sur un petit véhicule au sol que sur un vaisseau plus imposant demandant une puissance plus importante. La distinction était cependant très claire : un petit véhicule au sol ne pouvait que rarement dépasser un mètre en suspension tandis que les dispositifs plus gros pouvaient aller jusqu’à traverser les couches supérieures d’une atmosphère. La polyvalence et la qualité de ce moteur étaient ses principaux points forts. Il était silencieux, efficace, propre et pouvait s’adapter à n’importe quel combustible utilisé en fonction des planètes. Quant à son fonctionnement, il n’était pas difficile à comprendre. Le moteur à propulsion créait un champ de gravité négatif, se détournant ainsi des lois logiques de cette même gravité. Placé sous le véhicule, le moteur à répulsion soulevait alors le véhicule du sol. Ensuite, le conducteur pouvait modifier les fonctions du champ de gravité : en prenant en compte le poids, la marque de construction, le chargement et autres conditions, le conducteur était alors en mesure d’atteindre une certaine hauteur maximale appelée aussi « plafond de vol ». Quelques exemples : le speeder de Luke, qui détenait cette technologie, témoignait de son efficacité d’utilisation. Propulsant le véhicule à environ un mètre du sol, le speeder devenait idéal pour parcourir les plaines inégales et rocheuses de Tatooine. Quant à la circulation sur Coruscant, on pouvait constater que les moteurs étaient bien plus puissants, permettant la circulation des véhicules à des hauteurs impressionnantes. Gare aux pannes ! Le célèbre Sith Dark Maul utilisa un speeder doté d’un moteur à répulsion, capable de gérer de belles accélérations ainsi que des virages brutaux. De même, mis à part son système anti-gravité, le moteur à répulsion permettait la propulsion d’un véhicule à une vitesse raisonnable. Mais la grande majorité des amateurs de courses et de vitesse aimaient rajouter des moteurs ioniques pour augmentait la vitesse de leurs engins à plus de 1000 km/h. Et cette technologie ne s’arrêtait pas là. En effet, le moteur à répulsion servait aussi bien pour des manipulations délicates telles que le décollage ou l’atterrissage d’un engin quelconque et était utilisé également dans le cadre de système de sécurité, créant un champ de répulsion protecteur en cas d’arrêt brutal ou autre type d’accident. Contrairement à ce que l’on pouvait croire, la technologie du moteur à répulsion n’était pas seulement utilisée sur les véhicules. Il suffisait juste de regarder certains droïdes, en particulier les droïdes astromécanos, qui utilisaient cet outil au détriment de roues ou autre système de contact au sol. Cela leur permettait de plus d’obtenir une meilleur stabilité. Il était aussi employé dans des gadgets très pratiques. Par exemple, il pouvait, sous forme de cellule énergétique durant en général peu de temps, permettre de contrôler la vitesse et la direction d’un grappin tiré depuis un blaster. Autre utlisation : le moteur servait également sur des paquetages imposants, enlevant ainsi la difficulté de soupeser des masses trop grandes. Il était de plus tout aussi bien utilisé sur des ceintures ou des bottes, ce qui permettait à l’utilisateur de décoller un peu du sol. Et en dépit des véhicules, des droïdes, des armes et des utilisations gadgets, le moteur à répulsion était un élément indispensable dans certains loisirs tel que le sport du grav-ball, qui était principalement basé sur cette technologie.','Moteur à Répulsion',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (602,'Les mqaaq’it sont des implants oculaires cousins du plaeryin bol qui améliorent la vision en élargissant le spectre de fréquence visuelle perçu par le greffé. Ces créatures jaunes sont utilisées par les Yuuzhan Vong pour remplacer des yeux perdus au combat ou sacrifiés aux dieux. Il existe une version externe du mqaaq’it pour ceux qui ont encore leurs yeux d\'origine. Une fois sur le porteur, le mqaaq’it change de couleur selon l’humeur du Yuuzhan Vong.','Mqaaq\'it',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (603,'Le navicerveau, ou cerveau-navigateur, est un navigateur spatial en forme de cerveau utilisé dans les vaisseaux Yuuzhan Vong.','Navicerveau',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (604,'Le neathlat est un bandage vivant Yuuzhan Vong qui aiguise la souffrance infligée par une blessure tandis qu\'il la guérit.','Neathlat',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (605,'Le neuromoteur est une forme de propulsion organique Yuuzhan Vong en forme de ruche qui accueille des basals dovin.','Neuromoteur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (606,'Ces créatures sont utilisées par les Yuuzhan Vong en tant qu\'appareils de nettoyage. Les ngdins retirent le sang et les autres tissus des zones où des guerriers ou d\'autres créatures ont été blessés ou tués. Ils sont plutôt grassouillets à cause de la quantité de sang qu\'ils absorbent. Il est d\'usage chez les Vong de manger les ngdins quand ils atteignent une certaine corpulence. Les cils avec lesquels ils se déplacent peuvent délivrer des piqûres engourdissant celui qui les touche.','Ngdin',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (607,'Les nids superposés sont de petites alcôves dans les vaisseaux Yuuzhan Vong, servant au rangement.','Nid superposé',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (608,'Le nisbat est une créature Yuuzhan Vong minuscule qui permet de traquer son porteur, à l\'instar des mouchards traditionnels mécaniques.','Nisbat',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (609,'Un nodule sensitif est une partie d\'un vaisseau Yuuzhan Vong : il relaie l\'information sur l\'environnement dans lequel évolue le vaisseau, à l\'instar de senseurs.','Nodule sensitif',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (610,'Les os tong servent à sortir la nourriture de brasiers brûlant. Beaucoup de Yuuzhan Vong préfèrent utiliser leurs doigts nus.','Os tong',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (611,'Les polypes hau sont des créatures souples composées de fibres rouges. Les Yuuzhan Vong s’en servaient de fauteuil de luxe.','Polype hau',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (612,'C\'est un spray antispetique, désinfectant.','Porrh',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (613,'Les q’et sont l’équivalent biologique de sacs dans lesquels les Yuuzhan Vong mettaient d’autres formes de vie. Créature mince comme une pellicule qui s\'adapte au corps du porteur, le q’et est utilisé par la caste des modeleurs Yuuzhan Vong pour mettre en sécurité et transporter du matériel biologique. La créature lubrifie les échantillons avec des fluides riches en oxygène qui les gardent en bonne santé pendant le voyage. Ce sac tacheté d\'olive et de noir possède encore des vestiges des yeux de ses ancêtres aquatiques.','Q\'et',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (614,'Ayant été introduit à l\'origine dans la civilisation Yuuzhan Vong comme ordinateur de bord de la plupart des vaisseaux biologiques, le qahsa est aussi un appareil de mémoire portable. L\'énorme Qang qahsa à bord d\'un vaisseau-monde contient les connaissances collectives de toute la race Yuuzhan Vong, tandis qu\'un qahsa portable ne peut contenir que les données nécessaires dans une certaine situation. Utilisant des associations nerveuses particulières, le qahsa portable peut être connecté à un qahsa fixe pour transférer des nouvelles données ou des renseignements scientifiques. Pour accéder à un Qahsa, un Yuuzhan Vong doit utiliser un dénoueur génétique, sorte de clé.','Qahsa',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (615,'Le rayon tracteur était une technologie utilisée depuis des millénaires et son efficacité en fit un outil qui perdura pendant très longtemps. Il fut à l’origine un mécanisme innovateur dans le monde du commerce. Tandis que les anciens mineurs et autres commerçants se servaient encore de grappins afin d’attirer vers eux les richesses nécessaires à leur développement, le rayon tracteur fut une véritable révolution commerciale. Il augmenta la rapidité, la qualité et la sécurité. Il devint ainsi la technologie idéale pour la croissance et l’avancée du commerce. Mais il ne fallut pas longtemps pour que le rayon tracteur soit utilisé à des fins plus sinistres. Les organisations militaires se rendirent compte qu’ils pouvaient tirer un bon profit de cette technologie pourtant commerciale à l’origine. Ainsi, le rôle principal du rayon tracteur déclina plus tard sur le rapatriement de vaisseaux endommagés et sur la mise en place de pièges, afin d’attirer les vaisseaux ennemis et d’entreprendre ainsi leurs abordages.','Rayon Tracteur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (616,'Le recham fortep était utilisé dans les gueules luur afin d’absorber les exhalations de méthane.','Recham fortep',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (617,'Les rikyams sont les cerveaux centraux des vaisseaux-monde Yuuzhan Vong. Croisements entre le yammosk et le dhuryam (sans que la même importance religieuse leur soit accordée), ils contrôlent tous les échanges biologiques à bord du vaisseau, notamment le contrôle environnemental, la supervision de l\'élevage des créatures, le maintien des fonctions élémentaires du navire. Le rikyam régule également les spasmes musculaires et nerveux de tous les organismes constituant le vaisseau-monde afin qu\'ils ne troublent en rien le bon déroulement des interactions biologiques.','Rikyam',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (618,'Bien qu’elle n’offre peu de protection, la robepeau est un habit commun chez les Yuuzhan Vong. Formée d’une épaisse gélatine, la robepeau est une créature fascinante. Comme toutes les créatures Yuuzhan Vong, elle est entièrement autonome : elle se nourrit de la sueur et du sébum sécrétés par les corps des porteurs. Elle permet également d’accélérer la guérison de certaines plaies en se chargeant de digérer la chair morte et certaines bactéries pathogènes.','Robepeau',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (619,'Le sas sphincter est utilisé comme porte, qui réagit à la phéromone de passage. Celle-ci est une technologie Yuuzhan Vong qui permet à qui la possède d\'ouvrir certains accès restreints.','Sas Sphincter',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (620,'Les scarabées-pinces sont de petites créatures très utiles. Leurs mandibules puissantes peuvent servir à relier deux morceaux de tissu, de robepeau, ou d\'autre tissu vivant. Il suffit pour cela de les presser, d\'installer les mandibules alors écartées de part et d\'autre -par exemple- d\'une plaie à refermer, puis d\'arracher la tête pour sécuriser l\'attache. L\'abdomen peut être pressé : la chair du scarabée clip est comestible et goûtue.','Scarabée-pince',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (621,'Similaires aux turfhopper, les scarabées-sentinelles font le travail de surveillance des guerriers et agitent les ailes lorsqu’un intrus ou un ennemi est signalé. Alerté par le bruit, le guerrier peut alors se charger du problème.','Scarabée-sentinelle',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (622,'Cette créature sert d\'outil de rangement pour les Yuuzhan Vong. Elle est couramment utilisée pour ranger des effets personnels tels qu\'un villip ou un coufee. La sclipune possède une coquille segmentée articulée par un tissu sensible. En effectuant une combinaison de mouvements rapides sur le tissu sensible, la sclipune s\'ouvrira à son propriétaire.','Sclipune',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (623,'Ce senseur détecte la chaleur corporelle dégagée par des intrus.','Senseur à puits de chaleur',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (624,'Les sensilimaces sont utilisées pour l’espionnage. En libérant une composition chimique volatile, ces créatures sont capables d’endormir un humanoïde à proximité. Des versions modifiées étaient également utilisées pour « assouplir » les candidats des sacrifices au Yun’o, les effets du gaz étant assez désagréables : nausées, nez irrité, maux de tête.','Sensilimace',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (625,'Bien que sa méthode de brouillage soit peu claire, le Shreeyam’tiz est une puissante créature Yuuzhan Vong élaborée pour annihiler les plus puissants signaux télépathiques, en particulier ceux des dhuryams. Le Shreeyam’tiz est ainsi utilisé pour couper les dhuryams de leurs esclaves et les laisser s’entretuer le Jour de la Compréhension de la Volonté des Dieux.','Shreeyam’tiz',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (626,'Un siège-épineux est un type de chaise infligeant de la douleur à son occupant. Il ne servait pas d\'instrument de torture et accueillait plutôt les officiers Yuuzhan Vong désireux d\'embrasser la souffrance. L\'utilisateur s\'asseyait et les épines suçaient le sang de son dos et de son postérieur. C\'est ainsi que la chaise se nourrissait.','Siège-épineux',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (627,'Variante du crabe Vonduun utilisé comme armure par les Yuuzhan Vong, les sondes en crabe Vonduun sont utilisées pour collecter des informations tout en restant discrètes. Comme tous les crabes Vonduun, les sondes sont mortellement allergiques au pollen des arbres baffor. Cette allergie permit aux Vong de découvrir l\'origine du virus qui attaquait leurs armures.','Sonde en crabe Vonduun',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (628,'Produites par la stupéfiante ingénierie génétique des Yuuzhan Vong, les sphères rouges sont des appareils vivants utilisés pour modifier chimiquement l\'eau d\'une planète. Le dérivé de cette réaction chimique est adapté à l\'élevage des basals dovin. Sur Tynna, les Vong utilisèrent ces appareils pour colorer en jaunâtre un lagon autrefois aussi transparent que du cristal. Les envahisseurs prévoyaient d\'utiliser l\'eau de Tynna pour élever des basals dovin de taille suffisante pour dépouiller les mondes du Noyau de leurs puissants boucliers planétaires.','Sphère rouge',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (629,'Les sprays salins sont des créatures en forme de sac utilisées pour nettoyer les vaisseaux-mondes Yuuzhan Vong. Quand on le stimule sur une terminaison nerveuse, le spray salin libère un jet d\'eau sous pression qui lave entre autres les débris des crevasses entre les rechams forteps.','Spray salin',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (630,'Le Stimulateur cérébro-spinal est un outil biologique utilisé par la caste des modeleurs pendant la modification des êtres humanoïdes. La créature est liée au système nerveux du sujet et est utilisée pour délivrer directement de la douleur au cerveau. Les Yuuzhan Vong l\'utilisent pour briser la volonté d\'un prisonnier, afin de le rendre plus facile à manipuler et de cartographier son système nerveux. Le Stimulateur est contrôlé par un organisme symbiote appelé ol-villip.  ','Stimulateur cérébro-spinal',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/spineray_avv6.jpg'),
 (631,'Le swarbirk est une créature très robuste qui peut se régénérer très rapidement et, en cas d\'attaque, sécréter un gaz toxique pour tuer ses agresseurs. Elle sert de porte lourde pour empêcher les individus de rentrer dans des zones restreintes des bâtiments Yuuzhan Vong.','Swarbirk',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (632,'Le Tall-Yor, plus communément appelé capuchon cognitif, est l\'interface que les pilotes Yuuzhan Vong utilisent pour interagir avec leur vaisseau. Le capuchon cognitif fait partie intégrante du vaisseau organique. Il envoie au pilote les informations transmises par le yammosk dans le langage des Yuuzhan Vong et répond aux sollicitations physiques qui lui sont imposées et que seuls les Yuuzhan Vong semblent capables de réaliser. Le Tall-Yor est aussi le module de communication entre les différents vaisseaux composant une flotte et possède une mémoire propre qui lui permet d\'enregistrer des mouvements que le pilote effectue régulièrement afin de rendre plus précises les procédures et les attaques.','Tall yor',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/tal_yor_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (633,'Le tapiq est un animal couvert d’épines qui peut projeter un venin paralysant capable de désactiver le système de sécurité d’un damutek.','Tapiq',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (634,'Les tapis microbiens sont des couches de mélasses bactériennes que les Yuuzhan Vong utilisent pour faire pousser les membranes oqa.','Tapis microbien',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (635,'Les tentacules d\'entrave sont une extrusion partant du nez des vaisseaux Yuuzhan Vong afin d\'aborder et capturer les vaisseaux ennemis.','Tentacule d\'entrave',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (636,'Les tii sont utilisés dans les cloîtres à endocrine.','Tii',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (637,'Le transporteur husk permet de transporter des charges peu importantes et des corps.','Transporteur husk',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (638,'Les tyzowyrms sont des petites créatures rampantes élevées par les généticiens Yuuzhan Vong afin de traduire d\'autres langues. Il se réunit avec son hôte en creusant dans la cavité de son oreille. En plaçant simplement un doigt sur son oreille, l\'utilisateur lance le fonctionnement du tyzowyrm. Quand elle travaille, la créature émet des faibles vibrations qui signalent qu\'elle effectue sa tâche correctement. Ce sont des décodeurs et malgré leur taille minuscule, ils peuvent stocker d\'énormes quantités d\'informations et peuvent les émettre par message subliminal. Yomin Carr utilisa l\'une de ces créatures quand il se fit passer pour un scientifique de la société ExGal.','Tyzowyrm',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (639,'Pour s\'amarrer à d\'autres vaisseaux ou à des stations spatiales, les êtres utilisant la technologie moderne emploient des tubes d\'arrimage pour servir de pont entre les deux vaisseaux spatiaux. Les Yuuzhan Vong élèvent des vers molleung pour la même utilisation : ils servent de tubes d\'arrimage géants. Sur la planète Helska IV, les Vong utilisèrent ces vers pour pouvoir circuler librement entre leur base secrète dans la glace et leurs vaisseaux biologiques. D’autres barges de débarquement utilisent aussi ce procédé pour permettre aux Vong de débarquer de ces vaisseaux.','Ver Molleung',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (640,'Les vers-sacs servent de récipient pour la soupe et d’autres aliments Yuuzhan Vong.','Ver-sac',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (641,'Le vêtement-filet s\'attache directement à la peau de celui qui le porte. Il était très utilisé chez les Humiliés.','Vêtement-filet',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (642,'Ce sont des créatures vivantes utilisées en tant qu’appareils de communication par les Yuuzhan Vong. Ils ressemblent à une balle membraneuse de cuir marron possédant des rides. Chaque villip est lié mentalement à un jumeau utilisé par un autre individu. L\'utilisateur caresse le dessus du villip pour le réveiller et un petit mouvement signale que son homologue est lui aussi en fonctionnement. Un trou ressemblant à l’orbite d’un œil apparait alors dans la chair membraneuse. Ce trou central se plisse et s’ouvre de plus en plus jusqu’à faire se retourner la membrane pour prendre l’apparence du propriétaire de l’autre villip. Les villips sont employés pour de nombreuses fonctions qui ne sont pas limitées aux communications personnelles. On peut les utiliser comme interphones, permettant à un individu se trouvant dans une pièce de voir et d\'entendre qui demande à entrer. De larges terrains de villips peuvent être créés pour former un chœur de villips. Ces terrains panoramiques sont utiles pour l\'observation et le commandement d\'une bataille ainsi que pour superviser les opérations d\'une flotte. De nombreuses sous-espèces de villips existent mais l\'une des plus employées est une petite créature qui peut être portée autour du cou. Ce villip ressent les vibrations du larynx, qu\'il transmet en mots et qu\'il envoie à un autre. D\'autres villips sont si petits qu\'ils peuvent entrer dans l\'oreille d\'un individu. Ces variantes sont pratiques pour les opérations spatiales, car l\'utilisateur peut se servir de son villip en tandem avec un gnullith résistant au vide et une armure ooglith. Les plus grands mollusques servent de maîtres-villips et ce sont eux qui sont chargés de pondre. Les bourgeons de villips sont nourris à bord de pépinières par les généticiens. Le plus grand villip existant fut élevé par les maîtres généticiens du vaisseau Sunulock pour le Maître de Guerre Tsavong Lah. Son jumeau fut délivré dans l’espace pour pouvoir communiquer avec des agents installés sur Coruscant.','Villip',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/villip_avv6.jpg'),
 (643,'Il s\'agit d\'une substance Yuuzhan Vong fabriquée à partir de matière organique et utilisée comme tapis vurruk, des tapis particulièrement confortables.','Vurruk',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (644,'Les Yuuzhan Vong ont conquis une vaste portion de la galaxie. Grâce au pillage de ces mondes, les envahisseurs extragalactiques ont pris possession d\'un nombre incalculable d\'esclaves. Leurs premières expérimentations de contrôle des esclaves par ces implants de corail yorik échouèrent car les excroissances calcifiées, implantées par des créatures calcificatrices, puisaient dans l\'énergie et la force vitale des esclaves. Les esclaves, vidés, finissaient par mourir ou perdaient la raison à cause de la douleur insoutenable que délivraient ces excroissances. Dans certains cas, leurs corps étaient entièrement recouverts par les calcifications qui formaient une puissante armure mais les esclaves n\'y survivaient pas. De récentes découvertes de la caste des modeleurs se sont révélées plus efficaces. Les implants ne drainent plus la volonté des esclaves. Au lieu de cela, ils emprisonnent les esclaves en délivrant de la douleur, la paralysie, ou en cas de nécessité, la mort.','Yorik kul',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/yorik_kul_avv6.jpg'),
 (645,'Le yorik-ta est l’équivalent Yuuzhan Vong de la nacelle d’évacuation. Comme les vaisseaux, la nacelle est en corail yorik et possède un basal dovin pour sa propulsion et sa défense.','Yorik-ta',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (646,'Le cristal Kyber, appelé aussi cristal de mémoire Kyber, était un cristal de données où étaient stockées des informations particulièrement primordiales pour l’Ordre Jedi. Il contenait en effet la liste de tous les nouveaux-nés de la galaxie sensibles à la Force. La division Acquisition de l’Ordre Jedi, chargée de repérer et d’amener au Temple les jeunes sensibles à la Force, en avait donc une grande utilité dans sa délicate tâche. Le cristal Kyber représentait ainsi le futur de l’Ordre, les prochaines générations de chevaliers Jedi et avait donc une importance vitale. Pour accéder aux données qu’il contenait, le seul moyen était de l’insérer dans un holocron Jedi. Ces derniers ne pouvant être activés uniquement par la Force, seul un Jedi pouvait utiliser le cristal Kyber, une sécurité supplémentaire particulièrement efficace.','Cristal Kyber',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/cristal_kyber_avv6.jpg'),
 (647,'Le Gaz de Dorin se rencontre uniquement sur la planète Dorin où vivent les Kel Dor, représentés notamment par Maître Plo Koon de l’Ordre Jedi. Le Gaz de Dorin est pour les Kel Dor l’équivalent de l’Oxygène pour les Humains. Dans un milieu où il n’y a pas ce gaz, ils doivent porter un masque respiratoire et des lunettes spéciales. Sans cet équipement ils seraient aveugles et mourraient d’asphyxie.','Gaz',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/gazava.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (648,'Les grains d\'halurium étaient une source d\'énergie considérable et servaient à alimenter de nombreux objets et notamment certaines sculptures, comme celles de lumière de l\'artiste Ves Volette.','Halurium',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (649,'L\'isotope 5 était un des isotopes radioactifs de l\'illérium, un élément chimique volatil très recherché utilisé dans la construction de vaisseaux. La particularité de cet isotope était sa radioactivité extrêmement élevée qui en faisait une source d\'énergie quasi-inépuisable. D\'après certains scientifiques, un simple microgramme aurait permis d\'alimenter un datapad pour une centaine d\'années. Cependant, l\'isotope 5 n\'était présent que dans les étoiles à neutron et donc inaccessible. C\'est du moins ce que tout le monde croyait jusqu\'à ce que Toborro le Hutt, éminent membre du Cartel, s\'empare de la planète Makeb vers 3640 avant la Bataille de Yavin, où il fit construire d\'énormes lasers et engins d\'extraction afin de récupérer l\'isotope 5 abondamment présent dans la croûte terrestre. A grands renforts de menaces et de pots-de-vin, Toborro réussit à contrôler entièrement la planète qui fut coupée du reste de la Galaxie afin de garder secrète l\'exploitation de l\'élément. Le Cartel des Hutts, alors au sommet de sa forme et convaincu de sa supériorité sur l\'Empire et la République, se lança dans la conquête de nouveaux territoires en débutant le développement d\'une gigantesque armée de droides alimentés par l\'élément radioactif. Avec une telle source d\'énergie, ces droides possédaient une puissance de feu et des boucliers incomparables. Malgré tous leurs efforts pour dissimuler cette petite révolution scientifique, les Services Secrets Impériaux et notamment Dark Marr eurent vent de l\'affaire et dépêchèrent discrètement leurs troupes afin de reprendre Makeb et s\'emparer de l\'isotope, qui serait un avantage considérable dans la guerre qui les opposait à la République Galactique. Cet événement, connu plus tard comme la Bataille de Makeb, vit la victoire des forces impériales malgré les nombreuses difficultés pour stabiliser le noyau de la planète fragilisé par l\'extraction intensive de l\'isotope. Ce succès fut d\'autant plus éclatant que la République n\'eut jamais connaissance de l\'élément chimique malgré sa présence sur Makeb pour aider la population.','Isotope 5',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/isotope5_avatar_v6.jpg'),
 (650,'La Marilite est une gemme précieuse renfermant une énorme quantité d\'énergie. Durant l\'Ancienne République, et principalement lors de la Guerre Froide entre la République et l\'Empire Sith, la marilite était utilisée dans la construction d\'armes, aussi bien pour des blasters que des sabres lasers. Mais avec les millénaires, les sources de marilite s\'amoindrirent et ces gemmes devinrent de plus en plus rares, à tel point que certaines se retrouvaient dans des œuvres d\'art onéreuses. Preuve en est avec les magnifiques sculptures de lumière de l\'artiste Ves Volette, en 19 avant la Bataille de Yavin. Jax Pavan, l\'un des rares Jedi ayant survécu à l\'Ordre 66, tenta d\'acquérir une marilite en proposant de la retirer d\'une de ces sculptures, afin de se construire un nouveau sabre laser. Sa requête fut bien évidement rejetée car, sans marilite, les œuvres étaient automatiquement détruite.','Marilite',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (651,'Le Duracier (Durasteel) est un matériau métallique versatile. Il est très dur et prend son origine dans le mélange de plusieurs composant tels que : carvanium, lommite, neutronium, zersium, meleenium et carbone.','Métaux',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (652,'Le Rhydonium était un produit liquide combustible, comme du fuel, hautement explosif et très dangereux. Alors que la Guerre des Clones faisait rage, la Confédération des Systèmes Indépendants possédait une mine de Rhydonium sur Abafar, plus précisèment à Pons Ora. Les Séparatistes utilisèrent une faux croiseur Républicain rempli de Rhydonium afin de faire exploser une station spatiale Républicaine et tuer nombre de Jedi et clones lors d\'une conférence stratégique dans le système Carida. Malheureusement pour eux, R2-D2 et la D-Squad purent stopper le croiseur et empêcher le terrible attentat. En l\'an -5, Sabine Wren et Hera Syndulla trouvèrent du Rhydonium sur la base abandonnée de Fort Anaxes, située sur un astéroïde. Cette base appartenait à la République Galactique au temps de la Guerre des Clones. C\'est grâce à des dizaines de barils que les deux co-équipières purent tuer nombre de Fyrnocks qui les attaquaient par vague interminables.','Rhydonium',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/rhydonium_ava.jpg'),
 (653,'Le Permabéton (Permacrete) ou Durabeton (Duracrete) est un matériau extrêmement solide et résistant utilisé principalement dans la construction de plateformes de lancements ou des puits dans les spatioports. Il a l’inconvénient d’être lourd et ne peut être utilisé dans l’espace. Son origine daterait d’environ 9 000 ans avant la Bataille de Yavin.','Textures additionnelles',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (654,'Le thorilide était un minerai rare utilisé par l\'Empire dans la construction de leurs Destroyers Stellaires ainsi que dans d\'autres projets. Il se trouvait en abondance sur la planète Gorse et surtout sur sa lune, Cynda. L\'Empire utilisait les citoyens de Gorse pour extraire le minerai.','Thorilide',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (655,'La toile glista est un tissu utilisé dans les vêtements Yuuzhan Vong. La toile glista a une apparence brillante et luisante due à la génération d\'un champ qui neutralise les charges statiques environnantes. La toile glista est ainsi capable de repousser un tir de blaster, au même titre que l\'armure de crabe vonduun, mais était principalement utilisée comme robe de cérémonie.','Toile glista',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (656,'Les étranges mélodies jouées par les musiciens rituels de la caste des prêtres occupent une partie importante de la cérémonie des sacrifices effectuée par les Yuuzhan Vong. Le cortège comprend souvent plusieurs crustacés-lyres, des créatures aux longs membres produisant de la musique pour les dieux maléfiques des Yuuzhan Vong. Les pattes rouges du crustacé-lyre se bloquent en position tendue et sont réliées au corps par de nombreux tendons translucides. Les musiciens rituels pincent ces tendons pour produire des vibrations harmonieuses.','Crustacé-lyre',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/crustace-lyre_avv6.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (657,'Les crustacés-tambours, de même que les crustacés-lyres, sont souvent présents parmi le cortège musical de la caste des prêtres. Ces instruments vivants ont une double peau et possèdent deux saillies près de leur face supérieure qui contiennent une paire d\'yeux couleur émeraude. Quand le tambour est frappé assez fortement, il entraîne une contraction de la créature-garrot Tkun, étranglant la victime du sacrifice.','Crustacé-tambour',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (658,'Au cours de l’Histoire de l’Ordre, si le comlink Jedi était employé dans un premier temps pour repérer de futurs élèves, l’appareil le plus utilisé par la suite était appelé \'détecteur de Jedi\', ou encore \'écran de tests Jedi\', un équipement devant lequel les recrues potentielles devaient faire leurs preuves lorsqu’elles étaient amenées dans la chambre du Conseil. Cet appareil de conception très simple, constitué d’un écran rectangulaire ainsi que d’un manche pour le tenir ne contenait aucun mécanisme spécial. C’est avec la Force uniquement qu’il fonctionnait: un Maître Jedi du Conseil le tenait ainsi face à lui de manière à ce que le candidat ne le voit pas, et, par le biais de ses pouvoirs mentaux, le Maître projetait à distance des images que lui seul pouvait visualiser sur l’écran du détecteur de Jedi. Pour chacune des images projetées, le candidat devait décrire ce qu’il \'voyait\' en utilisant la Force, l’efficacité de ce test étant maximale puisqu’on ne pouvait tricher d’aucune façon. Cependant, de bons résultats aux tests ne signifiaient par pour autant que le candidat était sûr d’entrer dans les rangs de l’Ordre Jedi, car d’après leur expérience, certains membres du Conseil savaient que le comportement des individus qui leur étaient présentés était également à prendre en compte dans leur décision. Une autre version du Détecteur de Jedi fut également utilisée par l’Ordre, même s’il avait un tout autre mode de fonctionnement. Composé entre-autre d’un bloc de contrôle et d’un cristal analyseur, cet appareil portable laissait en effet apparaître une projection holographique du sujet analysé, qui, si elle était auréolée de bleu, indiquait que cette personne avait le potentiel suffisant pour devenir un Jedi. Malheureusement pour les membres de l’Ordre, de tels objets furent récupérés par le maléfique Empereur Palpatine lorsqu’il extermina ses ennemis dans leur propre Temple, puis furent confiés à ses sbires pour mener à bien la Grande Purge, avant d’être réemployés quelques années plus tard par Luke Skywalker, fondateur du Nouvel Ordre Jedi.','Détecteur de Jedi',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/detecteur_jedi_avv6.jpg'),
 (659,'Les dhuryams sont une création Yuuzhan Vong destinée à coordonner les formes de vie de tout un monde. Cousins et très similaires aux yammosks (le dhuryam est plus grand et plus puissant), ces treize créatures irremplaçables sont entraînés pour être plus qu’un coordonnateur de guerre : le pazhkic Yuuzhan’tar al’tirrna, ou Cerveau-Monde. L’un d’entre eux sera choisi pour assurer les processus biologiques de terraformation de Coruscant, nouvellement Yuuzhan’tar. Pour ce faire, le Cerveau-Monde doit être le meilleur, sélectionné lors d’un processus spécial appelé tizo’pil Yun’tchilat : le Jour de la Compréhension de la Volonté des Dieux. Les dhuryams qui s’entrainaient chacun sur leur territoire avec un groupe d’esclaves et un mini-écosystème à gérer furent coupés de leurs serviteurs grâce à une créature appelée Shreeyam’tiz, une version réduite d’un yammosk. Le Cerveau-Monde de Yuuzhan’tar fut en réalité choisi par Jacen Solo qui tua lui-même les douze autres lors de sa captivité. Le jeune Jedi lia ainsi une relation très forte avec le Cerveau-Monde, une sorte de partenariat qui s’avèrera décisif lors de la guerre. Après la guerre, le Cerveau-Monde fut laissé sur Coruscant, afin qu’il aide à la reconstruction de la planète en se chargeant des créatures biologiques des ses anciens maîtres.','Dhuryam',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (660,'Vouant un culte à leur divinité Shaa, la civilisation primitive Seylott vénérait également un antique artefact nommé Enfant de Shaa. Au sein de ces indigènes sensibles à la Force, l\'objet était également connu comme étant le \'Destructeur de Mondes\' car, s\'il était trop éloigné de la statue de sa \'mère\', les énergies de la Force qui y étaient concentrées pouvaient créer une perturbation assez importante pour faire disparaître un monde entier. C\'est en raison des pouvoirs qui étaient attribués à cette idole que, cinq ans après la Bataille de Naboo, le General Ashaar Khorda chargea les chasseurs de primes Jango Fett et Zam Wesell de lui ramener l\'Enfant de Shaa, afin de s\'en servir pour assouvir sa vengeance à l\'encontre de la République en détruisant Coruscant. Néanmoins, lorsque les deux mercenaires découvrirent ce que leur commanditaire avait l\'intention de faire, il tentèrent de l\'en empêcher et se trouvèrent un partenaire inattendu en la personne du Maître Jedi Yarael Poof. Même si Khorda et ses hommes furent finalement éliminés, l\'Enfant de Shaa avait pourtant été amorcé, et il fallut alors que le Jedi se sacrifie pour relier entre elles les énergies destructrices de l\'artefact et éviter le pire. Après cela, pris de remords, Fett et Wesell repartirent sur Seylott, où ils replacèrent l\'idole mystique dans les bras de sa \'mère\' afin que son pouvoir soit contrôlé comme auparavant.','Enfant de Shaa',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/enfant_shaa_avv6.jpg'),
 (661,'Les flitnats sont de petits insectes suceurs de sang. Ils se nourrissent du sang de leurs victimes et se déplacent en grand nombre.','Flitnat',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
INSERT INTO `product_ref` (`id_product_ref`,`description`,`product_name`,`category_id_category`,`url_image`) VALUES 
 (662,'Une autre des créations de Nom Anor, la limace-tunnel mange de la pierre tendre qu’elle dissout avec sa salive acide. La bactérie que ces créatures possèdent dans leurs intestins métabolise le rocher dévoré en nutriments. Nom Anor utilisa ceci à son avantage quand les limaces gonflèrent et moururent. Il disposa leurs corps dans des marais où les nutriments furent relâchés, enrichissant le sol empoisonné et les eaux souterraines.','Limace-tunnel',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (663,'Le poison irksh est particulièrement puissant et immédiatement fatal. Nom Anor l’utilisait régulièrement à de sombres desseins.','Poison irksh',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg'),
 (664,'Le tkun n’a été ajouté que très récemment au bestiaire Yuuzhan Vong sur la demande de Tsavong Lah. Le Maître de Guerre avait besoin d’un moyen rapide et efficace pour les sacrifices individuels, mais non-dénué de « signification spirituelle ». Le tkun est un serpent poilu écarlate fonctionnant comme un garrot. Ces créatures peuvent s’étendre pour doubler leur taille et sont extrêmement puissants malgré un petit gabarit. Au cours des cérémonies de sacrifices, le tkun se resserrera au rythme des sons d’un crustacé-tambour.','Tkun',4,'http://www.starwars-universe.com/images/encyclopedie/objets/avatars_v6/avatar_vide.jpg');
